     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Lord shall lift up a standard * unto the nations, and shall gather together the outcasts of Israel.</text:p>
