    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 1. </text:span>Véniet Dóminus, * et non tardábit, et illuminábit abscóndita tenebrárum, et manifestábit se ad omnes gentes, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 1. </text:span>The Lord will come, * and will not tarry; he both will bring to light the hidden things of darkness, and will make Himself manifest to all people, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
