     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>He shall sit * upon the throne of David, and upon his kingdom for ever, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
