     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GOD, who, at sundry times and in divers manners, spoke in times past to the fathers by the prophets, last of all, in these days hath spoken to us by his Son, whom he hath appointed heir of all things, by whom also he made the world.</text:p>
