    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Glória in excélsis Deo, et in terra pax homínibus bonæ voluntátis, allelúja, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Glory be to God in the highest; * and on earth, peace to men of good will, alleluia, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <table:table table:name="Table161" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">V. </text:span>Notum fecit Dóminus, allelúja.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Salutáre suum, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">V. </text:span>The Lord hath made known, alleluia.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>His salvation, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
