      <text:p text:style-name="BodyEDrop">O GOD, thou hast established thine Only-begotten Son as the Saviour of mankind, and commanded that he should be called Jesus; mercifully grant that we who venerate his Holy Name on earth, may also be filled with the enjoyment of the vision of him in heaven. Through the same.</text:p>
