   <text:p text:style-name="Rubric">The days from January 7 to January 12 are ferias of the Season of the Epiphany of the Lord:</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms, at all the Hours, are taken from the current day of the week, as in the Psalter. The short response at Prime, as on the feast of the Epiphany. The prayer is said as on the feast of the Epiphany: but on ferias occuring after the first Sunday, it is of the same Sunday.</text:p>
