   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 2:1,2,11</text:p>
   <table:table table:name="Table262" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ab Oriénte * venérunt Magi in Béthlehem adoráre Dóminum: et apértis thesáuris suis, pretiósa múnera obtulérunt: aurum, sicut Regi magno; thus, sicut Deo vero; myrrham, sepultúræ ejus, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>From the East * there came wise men to Bethlehem to adore the Lord: and opening their treasures, they offered him gifts; gold, as unto the Great King; frankincense, as unto the true God; and myrrh, for his burying, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table263" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui hodiérna die Unigénitum tuum Géntibus stella duce revelásti: concéde propítius; ut, qui jam te ex fide cognóvimus, usque ad contemplándam spéciem tuæ celsitúdinis perducámur. Per eúmdem Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, on this day, by the guiding star, you revealed thy Only-begotten Son to the Gentiles; mercifully grant, that we who now know thee by faith, may be led on even to look upon the beauty of thy Majesty. Through the same.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 2:10,11</text:p>
   <table:table table:name="Table264" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Vidéntes stellam Magi, * gavísi sunt gáudio magno: et intrántes domum, obtulérunt Dómino aurum, thus, et myrrham, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Seeing the star, the Magi * rejoiced with exceeding great joy: and entering into the house, they offered the Lord gold, frankincense, and myrrh.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
