     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tria sunt múnera, * quæ obtulérunt Magi Dómino, aurum, thus et myrrham, Fílio Dei, Regi magno, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The three gifts, * which the wise men offered unto the Lord: gold, frankincense, and myrrh; as unto the Son of God, the Great King, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
