    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui hodiérna die Unigénitum tuum Géntibus stella duce revelásti: concéde propítius; ut, qui jam te ex fide cognóvimus, usque ad contemplándam spéciem tuæ celsitúdinis perducámur. Per eúmdem Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, on this day, by the guiding star, you revealed thy Only-begotten Son to the Gentiles; mercifully grant, that we who now know thee by faith, may be led on even to look upon the beauty of thy Majesty. Through the same.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH">After the first Sunday after the Epiphany:</text:p>
   <table:table table:name="Table267" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">VOTA, quæsumus, Dómine, supplicántis pópuli cælésti pietáte proséquere: ut et quæ agénda sunt, vídeant, et ad implénda quæ víderint, convaléscant. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ATTEND, O Lord, we beseech thee, of thy heavenly mercy, to the desires of thy suppliant people; and grant that they may both perceive what they ought to do, and may have strength to fulfill the same. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <table:table table:name="Table268" table:style-name="TableParallel">
