    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Lux de luce * apparuísti, Christe, cui Magi múnera ófferunt, allelúja, allelúja, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Light of light, * thou hast manifested thyself, O Christ, and to thee the Wise men offer gifts, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
