    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Interrogábat * Magos Heródes: Quod signum vidístis super natum Regem? Stellam vídimus fulgéntem, cujus splendor illúminat mundum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Herod asked * the Wise Men, What sign saw ye over the King that is born? We saw a star shining, the brightness whereof enlighteneth the world.</text:p>
