     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Omnes natiónes * vénient a longe, portántes múnera sua, allelúja.</text:p>
