   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics45" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Epiphany</text:p>
   <text:p text:style-name="Hidden2">Epiphanytide</text:p>
   <text:p text:style-name="Head1NI">Die 11 Januarii</text:p>
   <text:p text:style-name="Head2">IV classis</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Is 60:14</text:p>
   <table:table table:name="Table273" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Vénient ad te, * qui detrahébant tibi, et adorábunt vestígia pedum tuórum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>They shall come to thee, * that slandered thee, and shall worship the steps of thy feet.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <text:p text:style-name="RubricH">Before the first Sunday after the Epiphany, the prayer, <text:span text:style-name="NonRubric">Deus, qui hodiérna</text:span>, as above; after the first Sunday after the Epiphany, the prayer, <text:span text:style-name="NonRubric">Vota, quæsumus</text:span>, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="RubricH">Commemoration is made ad Lauds of St. Hyginus, Pope and Martyr:</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Jn 12:25</text:p>
   <table:table table:name="Table274" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Qui odit * ánimam suam in hoc mundo, in vitam ætérnam custódit eam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>He that hateth * his life in this world, keepeth it to life eternal.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricHSm"><text:tab/>Ps 91:13</text:p>
   <table:table table:name="Table275" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">V. </text:span>Justus ut palma florébit.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Sicut cedrus Líbani multiplicábitur.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">V. </text:span>The just shall flourish like the palm tree.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>He shall grow up like the cedar of Libanus.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <table:table table:name="Table276" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">GREGEM tuum, Pastor ætérne, placátus inténde: et per beátum Hygínum, Mártyrem tuum atque Summum Pontíficem perpétua protectióne custódi; quem totíus Ecclésiæ præstitísti esse pastórem. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O ETERNAL Shepherd, do thou look with favor upon thy flock. Guard and keep it for evermore through blessed Hyginus, thy Martyr and Supreme Pontiff, whom thou didst choose to be the chief shepherd of the whole Church. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 2:12</text:p>
   <table:table table:name="Table277" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Admóniti Magi * in somnis, per áliam viam revérsi sunt in regiónem suam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Wise Men, being warned * in a dream, went back another way into their country.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics46" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Epiphany</text:p>
   <text:p text:style-name="Hidden2">Epiphanytide</text:p>
   <text:p text:style-name="Head1NI">Die 12 Januarii</text:p>
   <text:p text:style-name="Head2">IV classis</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Tim 3:16</text:p>
   <table:table table:name="Table278" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Maniféste magnum est * pietátis sacraméntum, quod manifestátum est in carne, justificátum est in spíritu, appáruit Angelis, prædicátum est Géntibus, créditum est in mundo, assúmptum est in glória, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Evidently great is * the mystery of godliness, which was manifested in the flesh, was justified in the spirit, appeared unto angels, hath been preached unto the Gentiles, is believed in the world, is taken up in glory.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <text:p text:style-name="RubricH">Before the first Sunday after the Epiphany, the prayer, <text:span text:style-name="NonRubric">Deus, qui hodiérna</text:span>, as above; after the first Sunday after the Epiphany, the prayer, <text:span text:style-name="NonRubric">Vota, quæsumus</text:span>, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <table:table table:name="Table279" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tribus miráculis * ornátum diem sanctum cólimus: hódie stella Magos duxit ad præsépium: hódie vinum ex aqua factum est ad núptias: hódie in Jordáne a Joánne Christus baptizári vóluit, ut salváret nos, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>A holy day we celebrate, * adorned with miracles. On this day a star led the Wise Men to the manger; on this day water was made wine at the marriage feast; on this day Christ willed to be baptized of John in the Jordan, that he might save us, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics47" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Body"><draw:frame draw:style-name="fr7" draw:name="graphics48" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6201in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Epiphany</text:p>
   <text:p text:style-name="Hidden2">Baptism of our Lord</text:p>
   <text:p text:style-name="Head1">Baptismatis D.N.J.C.</text:p>
   <text:p text:style-name="Head2">January 13 - II classis</text:p>
   <text:p text:style-name="Rubric">If the commemoration of the Baptism of our Lord falls on Sunday, the Office of the feast of the Holy Family is said without any commemoration.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table280" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, cujus Unigénitus in substántia nostræ carnis appáruit: præsta, quæsumus; ut per eum, quem símilem nobis foris agnóvimus, intus reformári mereámur: Qui tecum vivit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, whose Only-begotten Son appeared in the substance of our flesh, grant, we beseech thee, that by him, in whom outwardly we recognize our likeness, we may deserve to be inwardly created anew. Who with thee.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Rubric">All is said as on the feast of the Epiphany, except the prayer as above.</text:p>
   <text:p text:style-name="Rubric"/>
   <text:p text:style-name="Rubric">At the Little Hours, antiphons and psalms of the feria, and the rest as on the feast of the Epiphany, with the proper prayer as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Rubric">All is said as at II Vespers on the feast of the Epiphany, except the prayer as above.</text:p>
   <text:p text:style-name="Rubric">If the feast falls on Saturday, at Vespers there is no commemoration made of the following Sunday.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Compline taken from Sunday.</text:p>
   <text:p text:style-name="Rubric"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics49" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Body"><draw:frame draw:style-name="fr7" draw:name="graphics50" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6201in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Epiphany</text:p>
   <text:p text:style-name="Hidden2">First Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica I Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">The Office is said of the Holy Family, without commemoration of the Sunday.</text:p>
   <text:p text:style-name="Rubric">The prayer of this Sunday is said in the Office of the feria occuring within the following week.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table281" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">VOTA, quæsumus, Dómine, supplicántis pópuli cælésti pietáte proséquere: ut et quæ agénda sunt, vídeant, et ad implénda quæ víderint, convaléscant. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ATTEND, O Lord, we beseech thee, of thy heavenly mercy, to the desires of thy suppliant people; and grant that they may both perceive what they ought to do, and may have strength to fulfill the same. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">After Compline of January 13, the Season of the Epiphany ends and the Season throughout the Year before Septuagesima begins.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics51" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Head0">Tempus Per Annum</text:p>
   <text:p text:style-name="Body"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics52" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Per Annum</text:p>
   <text:p text:style-name="Hidden2">Second Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica II Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table282" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempiterne Deus, qui cæléstia simul et terréna moderáris: supplicatiónes pópuli tui cleménter exáudi; et pacem tuam nostris concéde tempóribus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and eternal God, you govern all things in heaven and on earth; in thy mercy hear the supplication of thy people, and grant thy peace in our times. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">All as in Saturday Vespers.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn. 2:1</text:p>
   <table:table table:name="Table283" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Núptiæ factæ sunt * in Cana Galilææ, et erat ibi Jesus cum María matre sua.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>There was a marriage * in Cana of Galilee: and Jesus was there, with Mary, his mother.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table284" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Deficiénte vino, * jussit Jesus impléri hydrias aqua, quæ in vinum convérsum est, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The wine failing, * Jesus commanded the water pots to be filled with water, which was changed into wine, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics53" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Per Annum</text:p>
   <text:p text:style-name="Hidden2">Third Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica III Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table285" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, infirmitátem nostram propítius réspice: atque ad protegéndum nos déxteram tuæ majestátis exténde. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and everlasting God, graciously look upon our infirmity, and, for our protection, stretch forth the right hand of thy Majesty. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">All as in Saturday Vespers.</text:p>
