      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 2. </text:span>I will praise * thee, because thou hast heard me.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 3. </text:span>Deus, Deus meus, * ad te de luce vígilo, quia factus es adjútor meus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 3. </text:span>O God, my God, * to thee do I watch at break of day, because thou hast been my helper.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 4. </text:span>Benedíctus es * in firmaménto cæli, et laudábilis in sæcula, Deus noster.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 4. </text:span>Blessed art thou * in the firmament of heaven: and worthy of praise for ever, O our God.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 5. </text:span>Laudáte * Dóminum de cælis.‡</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>Praise ye * the Lord from the heavens.‡</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers</text:p>
   <text:p text:style-name="Rubric">Hymn as in Sunday Lauds</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt. 20:1</text:p>
   <table:table table:name="Table302" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Símile est * regnum cælórum hómini patrifamílias, qui éxiit primo mane condúcere operários in víneam suam, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“The kingdom of heaven is like to an householder, who went out early in the morning to hire labourers into his vineyard,” saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Primam</text:p>
   <table:table table:name="Table303" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Conventióne autem * facta cum operáriis ex denário diúrno, misit eos in víneam suam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And having agreed * with the labourers for a penny a day, he sent them into his vineyard.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Tértiam</text:p>
   <table:table table:name="Table304" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ite et vos * in víneam meam, et quod justum fúerit, dabo vobis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Go you also * into my vineyard, and I will give you what shall be just.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday Terce.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Sextam</text:p>
   <table:table table:name="Table305" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quid hic statis * tota die otiósi? respondérunt, et dixérunt: Quia nemo nos condúxit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“Why do you stand * here all the day idle?” They answered and said unto him: “Because no man hath hired us.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Cor. 9:25</text:p>
   <table:table table:name="Table306" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNIS autem, qui in agóne contendit, ab ómnibus se ábstinet: et illi quidem ut corruptíbilem corónam accípiant, nos autem incorrúptam.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">AND every one that striveth for the mastery, refraineth himself from all things: and they indeed that they may receive a corruptible crown; but we an incorruptible one.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday Sext.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Nonam</text:p>
   <table:table table:name="Table307" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Voca operários, * et redde illis mercédem suam, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“Call the labourers, * and pay them their hire,” saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Cor. 10:4-5</text:p>
   <table:table table:name="Table308" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">BIBÉBANT autem de spiritáli, consequénte eos, petra: petra autem erat Christus: sed non in plúribus eórum beneplácitum est Deo.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">AND they drank of the spiritual rock that followed them, and the rock was Christ. But with most of them God was not well pleased</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday None.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Sunday Vespers</text:p>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers</text:p>
   <text:p text:style-name="Rubric">Hymn as in Sunday Vespers</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table309" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dixit paterfamílias * operáriis suis: Quid hic statis tota die otiósi? At illi respondéntes dixérunt: Quia nemo nos condúxit. Ite et vos in víneam meam: et quod justum fúerit, dabo vobis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The householder said * unto his laborers: “Why stand ye here all the day idle?” But they answering, said: “Because no man hath hired us.” “Go ye also into my vineyard, and I will give you what shall be just.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table310" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRECES pópuli tui, quæsumus, Dómine, cleménter exáudi: ut, qui juste pro peccátis nostris afflígimur, pro tui nóminis glória misericórditer liberémur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRACIOUSLY hear the prayers of thy people, we beseech thee, O Lord, that we, who are justly punished for our sins, may be mercifully delivered for the glory of thy name. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Secunda</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table311" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Hi novíssimi * una hora fecérunt, et pares illos nobis fecísti, qui portávimus pondus diéi, et æstus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>These last * have worked but one hour, and thou hast made them equal to us, who have borne the burden of the day, and the heat.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Tertia</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table312" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dixit autem paterfamílias: * Amíce, non fácio tibi injúriam: nonne ex denário convenísti mecum? tolle quod tuum est, et vade</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But the householder said: * “Friend, I do thee no wrong; didst thou not agree with me for a penny? Take that which is thine, and go thy way.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Quarta</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table313" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tolle quod tuum est, * et vade; quia ego bonus sum, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“Take that which is thine, * and go thy way; for I am gracious,” saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Quinta</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table314" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Non licet mihi, * quod volo fácere? an óculus tuus nequam est? quia ego bonus sum, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“Is it not lawful for me * to do what I will? Is thine eye evil, because I am gracious?” saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Sexta</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table315" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Depósuit Dóminus * poténtes de sede, et exaltávit húmiles.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Lord hath put down * the mighty from their seat, and hath exalted the humble.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Sabbato</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Rubric">Office of the feast or Saturday Office of BVM.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics59" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Body"><draw:frame draw:style-name="fr7" draw:name="graphics60" text:anchor-type="as-char" svg:width="3.4201in" style:rel-width="100%" svg:height="0.6201in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Septuagesima</text:p>
   <text:p text:style-name="Hidden2">Sexagesima</text:p>
   <text:p text:style-name="Head1">Dominica in Sexagesima</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table316" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui cónspicis quia ex nulla nostra actióne confídimus: concéde propítius; ut contra advérsa ómnia Doctóris Géntium protectióne muniámur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, you see that we do not trust in anything which we ourselves can do; mercifully grant, that by the protection of the Teacher of the Gentiles, we may be defended against all adversities. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:h text:style-name="Head3" text:outline-level="4"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Saturday Vespers.</text:p>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>2 Cor. 11:19-20</text:p>
   <table:table table:name="Table317" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">FRATRES: Libénter suffértis insipiéntes, cum sitis ipsi sapiéntes: sustinétis enim si quis vos in servitútem rédigit, si quis dévorat, si quis áccipit, si quis extóllitur, si quis in fáciem vos cædit.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">BRETHREN: For you gladly suffer the foolish; whereas yourselves are wise. For you suffer if a man bring you into bondage, if a man devour you, if a man take from you, if a man be lifted up, if a man strike you on the face.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Hymn as in Saturday Vespers.</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table318" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
