     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, O Lord, graciously hear our prayers; and having freed us from the bonds of our sins, guard us from all adversity. Through our Lord.</text:p>
