   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Saturday.</text:p>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Cor 13:1</text:p>
   <table:table table:name="Table336" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">FRATRES: Si linguis hóminum loquar et Angelórum, caritátem autem non hábeam, factus sum velut æs sonans, aut cymbalum tínniens.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">BRETHREN: If I speak with the tongues of men, and of angels, and have not charity, I am become as sounding brass, or a tinkling cymbal.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Hymn as in Saturday Vespers.</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table337" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Pater fídei nostræ * Abraham summus, óbtulit holocáustum super altáre pro fílio.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The father of our faith, * the mighty Abraham, offered a burnt offering on the altar for his son.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Psalms with Antiphons</text:p>
   <table:table table:name="Table338" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 1. </text:span>Secúndum multitúdinem * miseratiónum tuárum, Dómine, dele iniquitátem meam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 1. </text:span>According to the multitude * of thy tender mercies, O Lord, blot out my iniquity.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
<?php rubrics('ps/SuL2.php'); ?>
   <table:table table:name="Table339" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 2. </text:span>Deus meus es tu, * et confitébor tibi: Deus meus es tu, et exaltábo te.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 2. </text:span>Thou art my God, * and I will praise thee: thou art my God, and I will exalt thee.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 3. </text:span>Ad te de luce * vígilo, Deus, ut vídeam virtútem tuam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 3. </text:span>To thee do I watch * at break of day, O God, that I may see thy power.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 4. </text:span>Hymnum dícite, * et superexaltáte eum in sæcula.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 4. </text:span>Sing a hymn, * and exalt him above all for ever.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 5. </text:span>Omnes Angeli * ejus, laudáte Dóminum de cælis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>All his angels, * praise ye the Lord from the heavens.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Hymn as in Sunday Lauds.</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <table:table table:name="Table340" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ecce ascéndimus * Jerosólymam, et consummabúntur ómnia, quæ scripta sunt de Fílio hóminis: tradétur enim Géntibus, et illudétur, et conspuétur: et postquam flagellavérunt, occídent eum, et tértia die resúrget.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Behold we go up * to Jerusalem, and all things that are written by the Prophets concerning the Son of man shall be accomplished: for he shall be delivered unto the Gentiles, and shall be mocked and spit upon; and they shall scourge him, and put him to death, and on the third day he shall rise again.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Primam</text:p>
   <table:table table:name="Table341" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Iter faciénte * Jesu, dum appropinquáret Jéricho, cæcus clamábat ad eum, ut lumen recípere mererétur.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>As Jesus was journeying, * when he came near to Jericho, a blind man cried to him, that he might receive his sight.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Tértiam</text:p>
   <table:table table:name="Table342" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Transeúnte * Dómino, clamábat cæcus ad eum: Miserére mei, Fili David.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>As the Lord * passed by, the blind man cried unto him: “Son of David, have mercy on me.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday Terce.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Sextam</text:p>
   <table:table table:name="Table343" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Et qui præíbant, * increpábant eum ut táceret: ipse vero multo magis clamábat: Miserére mei, Fili David.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And many angrily * tried to silence him; but he cried out all the louder: “Son of David, have mercy on me.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Cor. 13:8-9</text:p>
   <table:table table:name="Table344" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CÁRITAS numquam éxcidit: sive prophetíæ evacuabúntur, sive linguæ cessábunt, sive sciéntia destruétur. Ex parte enim cognóvimus, et ex parte prophetámus.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">CHARITY never falleth away: whether prophecies shall be made void, or tongues shall cease, or knowledge shall be destroyed. For we know in part, and we prophesy in part.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday Sext.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Nonam</text:p>
   <table:table table:name="Table345" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cæcus magis * ac magis clamábat, ut eum Dóminus illumináret.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The blind man * cried out more and more, that the Lord would give him his sight.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Cor. 13:13</text:p>
   <table:table table:name="Table346" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">NUNC autem manent fides, spes, cáritas, tria hæc: major autem horum est cáritas.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">AND now there remain faith, hope, and charity, these three: but the greatest of these is charity.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Sunday None.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Sunday Vespers.</text:p>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Hymn as in Sunday Vespers.</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table347" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Stans autem Jesus, * jussit cæcum addúci ad se, et ait illi: Quid vis ut fáciam tibi? Dómine, ut vídeam. Et Jesus ait illi: Réspice, fides tua te salvum fecit. Et conféstim vidit, et sequebátur illum, magníficans Deum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But Jesus, standing, * commanded the blind man to be brought unto him, and saith to him: “What wilt thou that I should do unto thee?” “Lord, that I may see.” Jesus saith unto him: “Receive thy sight: thy faith has made thee whole.” And immediately he saw and followed him, glorifying God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table348" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRECES nostras, quæsumus, Dómine, cleménter exáudi: atque a peccatórum vínculis absolútos, ab omni nos adversitáte custódi. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, O Lord, graciously hear our prayers; and having freed us from the bonds of our sins, guard us from all adversity. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Secunda</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table349" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Et qui præíbant, * increpábant eum ut táceret: ipse vero multo magis clamábat: Miserére mei, Fili David.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And they that went before * rebuked him, that he should hold his peace. But he cried out so much the more: “Have mercy on me, thou Son of David.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Tertia</text:p>
   <text:p text:style-name="Head3">IV classis</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table350" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Miserére mei, * Fili David. Quid vis ut fáciam tibi? Dómine, ut vídeam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Have mercy on me, * thou Son of David. What wouldst thou that I should do unto thee? Lord, that I may receive my sight.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">After Compline of Tuesday of the week of Quinquagesima the Season of Septuagesima ends, and Lent begins.</text:p>
   <text:p text:style-name="BodySm"/>
