   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics64" text:anchor-type="as-char" svg:width="3.4201in" style:rel-width="100%" svg:height="1.0598in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/ihs.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
