   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Head0">Tempus Quadragesimæ</text:p>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Lent</text:p>
   <text:p text:style-name="Hidden2">Ash Wednesday</text:p>
   <text:p text:style-name="Head1">Feria IV Cinerum</text:p>
   <text:p text:style-name="Head2">I classis</text:p>
   <text:p text:style-name="Rubric">On this and the other ferias until None of the following Saturday inclusive, everything is said as on the preceding ferias after Septuagesima, except those things which are here given as proper.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 6:16</text:p>
   <table:table table:name="Table351" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum jejunátis, * nolíte fíeri sicut hypócritæ, tristes.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When you fast, * be not as the hypocrites, sad.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table352" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, Dómine, fidélibus tuis: ut jejuniórum veneránda solémnia, et cóngrua pietáte suscípiant, et secúra devotióne percúrrant. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, O Lord, to thy faithful people, that they may undertake with fitting piety the venerable solemnities of fasting, and complete them with steadfast devotion. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
