      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Thesaurizáte vobis * thesáuros in cælo, ubi nec ærúgo, nec tínea demolítur.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Lay up to yourselves * treasures in heaven: where neither the rust nor moth doth consume</text:p>
