    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">INCLINÁNTES se, Dómine, majestáti tuæ, propitiátus inténde: ut, qui divíno múnere sunt refécti, cæléstibus semper nutriántur auxíliis. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LOOK graciously, O Lord, upon those who bow down before thy Divine Majesty, that they who have been refreshed by thy divine gift may always be sustained by heavenly aids. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quinta</text:p>
