    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dómine, * puer meus jacet paralyticus in domo, et male torquétur: Amen dico tibi, ego véniam, et curábo eum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“Lord, * my servant lieth at home sick of the palsy, and is grieviously tormented.” “Amen, I say unto thee, I will come and heal him.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table356" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui culpa offénderis, pœniténtia placáris: preces pópuli tui supplicántis propítius réspice; et flagélla tuæ iracúndiæ, quæ pro peccátis nostris merémur, avérte. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, whom sin doth justly move to anger, and at repentance doth turn again to forgive the same; mercifully regard the prayers of your people, and turn aside the scourges of thy wrath, which we deserve for our sins. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 8:8</text:p>
   <table:table table:name="Table357" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dómine, * non sum dignus ut intres sub tectum meum: sed tantum dic verbo, et sanábitur puer meus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>O Lord, * I am not worthy that thou shouldst enter under my roof: but only say the word, and my servant shall be healed.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table358" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PARCE, Dómine, parce pópulo tuo: ut dignis flagellatiónibus castigátus, in tua miseratióne respíret. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">SPARE, O Lord, spare thy people, that they, being deservedly chastened, they may find solace through thy tender mercy. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
