      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum facis * eleemósynam, nésciat sinístra quid fáciat déxtera tua.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
