    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">INCHOÁTA jejúnia, quæsumus, Dómine, benígno favóre proséquere: ut observántiam, quam corporáliter exhibémus, méntibus étiam sincéris exercére valeámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">FURTHER with thy gracious favor, we beseech thee, O Lord, the fasts which we have begun, that we may be able to practice the bodily fasts which we keep, with sincere minds. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
