     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">TUÉRE, Dómine, pópulum tuum, et ab ómnibus peccátis cleménter emúnda: quia nulla ei nocébit advérsitas, si nulla ei dominétur iníquitas. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GUARD, O Lord, thy people, and from all their sins cleanse them; for no adversity shall harm them if no iniquity dominates them. Through our Lord.</text:p>
