      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Me étenim * de die in diem quærunt, et scire vias meas volunt</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>For they seek me * from day to day, sad desire to know my ways</text:p>
