    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ADÉSTO, Dómine, supplicatiónibus nostris: et concéde; ut hoc solémne jejúnium, quod animábus corporibúsque curándis salúbriter institútum est, devóto servítio celebrémus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">HEARKEN, O Lord, to our supplications; and grant that we may celebrate with devout service this solemn fast, which thou hast instituted for the healing of soul and body. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
