     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui Ecclésiam tuam ánnua Quadragesimáli observatióne puríficas: præsta famíliæ tuæ; ut, quod a te obtinére abstinéndo nítitur, hoc bonis opéribus exsequátur. Per Dóminum.</text:p>
