     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, thou who purify thy Church by the yearly observance of Lent, grant to thy family that what we endeavor to obtain from thee by abstinence, we may secure by good works. Through our Lord.</text:p>
