     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 3. </text:span>For thy mercy * is better than lives, O Lord: thee my lips shall praise.</text:p>
