    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 4. </text:span>In spíritu * humilitátis, et in ánimo contríto suscipiámur, Dómine, a te: et sic fiat sacrifícium nostrum, ut a te suscipiátur hódie, et pláceat tibi, Dómine Deus.</text:p>
