   <text:p text:style-name="Head2">ad Tértiam</text:p>
   <text:p text:style-name="Rubric">Antiphon as at Prime.</text:p>
   <text:p text:style-name="Rubric">Little Chapter As in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Lent.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Sextam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Mt 17:4</text:p>
   <table:table table:name="Table407" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Faciámus hic * tria tabernácula; tibi unum, Móysi unum, et Elíæ unum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Let us make here * three tabernacles, one for thee, and one for Moses, and one for Elias.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Thess. 4:3-4</text:p>
   <table:table table:name="Table408" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">HÆC est enim volúntas Dei, sanctificátio vestra: ut abstineátis vos a fornicatióne, ut sciat unusquísque vestrum vas suum possidére in sanctificatióne et honóre.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">FOR this is the will of God, your sanctification; that you should abstain from fornication; That every one of you should know how to possess his vessel in sanctification and honour.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Lent.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Nonam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Mt 17:9</text:p>
   <table:table table:name="Table409" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Visiónem quam vidístis, * némini dixéritis, donec a mórtuis resúrgat Fílius hóminis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Tell the vision that you have seen * no man, till the Son of man be risen from the dead.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Thess. 4:7</text:p>
   <table:table table:name="Table410" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">NON enim vocávit nos Deus in immundítiam, sed in sanctificatiónem, in Christo Jesu Dómino nostro.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">FOR God hath not called us unto uncleanness, but unto sanctification, in Christ Jesus our Lord.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Lent.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Sunday Vespers.</text:p>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Hymn as in Ordinary of Lent.</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 17:9</text:p>
   <table:table table:name="Table411" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Visiónem quam vidistis, * némini dixéritis donec a mórtuis resúrgat Fílius hóminis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Tell the vision that you have seen * no man, till the Son of man be risen from the dead.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Secunda</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 8:25</text:p>
   <table:table table:name="Table412" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego princípium, * qui et loquor vobis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I am the Beginning, * who also speak unto you.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table413" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut família tua, quæ se, affligéndo carnem, ab aliméntis ábstinet, sectándo justítiam, a culpa jejúnet. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God, that thy family, that as they abstain from meals to afflict the flesh; so by following after righteousness they may fast from sin. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 8:29</text:p>
   <table:table table:name="Table414" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Qui me misit, * mecum est, et non relíquit me solum: quia quæ plácita sunt ei, fácio semper.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>He that sent me * is with me, and he hath not left me alone: for I do always the things that please him.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table415" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ADESTO supplicatiónibus nostris, omnípotens Deus: et, quibus fidúciam sperándæ pietátis indúlges; consuétæ misericórdiæ tríbue benígnus efféctum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GIVE heed to our supplications, O Almighty God, and as thou dost give us to look with confidence for thy favor for which we hope, so grant us, in thy goodness, the manifestation of thine accustomed mercy. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Tertia</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 23:8</text:p>
   <table:table table:name="Table416" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Unus est * enim magíster vester, qui in cælis est, Christus Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>For one is * your Master, who is in heaven, Christ the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table417" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PERFICE, quæsumus, Dómine, benígnus in nobis observántiæ sanctæ subsídium: ut, quæ te auctóre faciénda cognóvimus, te operánte impleámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ENABLE us, we beseech thee, O Lord, to carry to a perfect end this holy and helpful observance, that what we know we must do by thy ordinance we may be helped to do by thy strength. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 23:8</text:p>
   <table:table table:name="Table418" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Omnes autem * vos fratres estis: et patrem nolíte vocáre vobis super terram: unus est enim Pater vester, qui in cælis est: nec vocémini magístri, quia magíster vester unus est Christus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But all you * are brethren: and call none your father upon earth; for one is your father, who is in heaven: neither be ye called masters; for one is your master, Christ.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table419" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PROPITIÁRE, Dómine, supplicatiónibus nostris, et animárum nostrárum medére languóribus: ut, remissióne percépta, in tua semper benedictióne lætémur. Per Domimum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LEND thy merciful ears, O Lord, unto our supplications, and heal the sickness of our souls, that we, receiving thy pardon, may rejoice for ever in thy blessing. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quarta</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 20:18</text:p>
   <table:table table:name="Table420" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ecce ascéndimus * Jerosólymam: et Fílius hóminis tradétur ad crucifigéndum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Behold, we go up * to Jerusalem, and the Son of man shall be betrayed to be crucified.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table421" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PÓPULUM tuum, quæsumus, Dómine, propítius réspice: et quos ab escis carnálibus præcipis abstinére, a nóxiis quoque vítiis cessáre concéde. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LOOK down in mercy on your people, we beseech thee, O Lord, and grant unto them, whom thou commandest to abstain from fleshly meats, power to abstain also from the corruption of sin. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 20:19</text:p>
   <table:table table:name="Table422" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tradétur enim Géntibus * ad illudéndum, et flagellándum, et crucifigéndum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>For he shall be delivered to the Gentiles * to be mocked, and scourged, and crucified.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table423" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, innocéntiæ restitútor et amátor, dírige ad te tuórum corda servórum: ut, spíritus tui fervóre concépto, et in fide inveniántur stábiles, et in ópere efficáces. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, Renewer and Lover of innocence, turn the hearts of all thy servants to thyself, that they, being enkindled with the fire of thy spirit, may be found ever rooted in faith, and fruitful in works. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quinta</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 16:25</text:p>
   <table:table table:name="Table424" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Fili, recordáre, * quia recepísti bona in vita tua, et Lázarus simíliter mala.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Son, remember * that thou didst receive good things in thy lifetime, and likewise Lazareth evil things.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table425" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA nobis, quæsumus, Dómine, auxílium grátiæ tuæ: ut jejúniis et oratiónibus conveniénter inténti, liberémur ab hóstibus mentis et córporis. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT unto us, we beseech thee, O Lord, the help of thy grace, that we, who are now bent on fasting and prayer, may be freed from enemies both of our bodies and of our souls. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table426" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dives ille * guttam aquæ pétiit, qui micas panis Lázaro negávit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>That rich man, * who had refused Lazarus bread-crumbs, cried for a drop of water.</text:p>
