   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table427" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ADÉSTO, Dómine, fámulis tuis, et perpétuam benignitátem largíre poscéntibus: ut iis, qui te auctóre et gubernatóre gloriántur, et congregáta restáures, et restauráta consérves. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">HELP, O Lord, thy servants, and grant unto their prayers the abiding effect of thy mercy: that as they make their boast in thee, who hast created and dost govern them, so thou wilt renew in them the gifts wherewith thou didst bountifully endow them, and wilt preserve what thou hast renewed. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
