      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Vadam ad patrem meum, * et dicam ei: Pater, fac me sicut unum ex mercenáriis tuis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I will go to my father, * and say to him: “Father, make me as one of thy hired servants.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table433" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA, QUÆSUMUS, Dómine, nostris efféctum jejúniis salutárem: ut castigátio carnis assúmpta, ad nostrárum vegetatiónem tránseat animárum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Lord, that our Fasts may bring forth their fruit unto salvation, that so the affliction which we lay upon our bodies may quicken our souls unto spiritual increase. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
