     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 2. </text:span>The Lord * is my helper: I will not fear what man can do unto me.</text:p>
