      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 4. </text:span>Vim virtútis suæ * oblítus est ignis: ut púeri tui liberaréntur illæsi.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 4. </text:span>The fire forgot his strength, * that thy children might be delivered therefrom.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 5. </text:span>Sol et luna, * laudáte Deum: quia exaltátum est nomen ejus solíus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>O sun and moon, * Praise ye God: for his name alone is exalted.</text:p>
     </table:table-cell>
