    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">JEJÚNIA nostra, quæsumus, Dómine, benígno favóre proséquere: ut, sicut ab aliméntis abstinémus in córpore; ita a vítiis jejunémus in mente. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LORD, we beseech the graciously to bless this our Fast, that we who are now outwardly denying meats to our bodies, may have power inwardly to keep our souls fasting from all sin. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
