    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut, qui in tua protectióne confídimus, cuncta nobis adversántia te adjuvánte vincámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God, that we whose trust is under the shadow of thy wings, may, through the help of thy power, overcome all evils that rise up against us. Through our Lord.</text:p>
