      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut, qui se, affligéndo carnem, ab aliméntis ábstinent; sectándo justítiam a culpa jejúnent. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God, that as many as, to afflict the body, do abstain from meats, may, by following after righteousness, fast from sin. Through our Lord.</text:p>
