      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 5. </text:span>Reges terræ * et omnes pópuli, laudáte Deum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>Kings of the earth * and all people, praise God.</text:p>
