     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When Jesus lifted up his eyes * and saw a very great multitude come to him, he said to Philip: “Whence shall we buy bread, that these may eat?” And this he said to try him; for he himself knew what he would do.</text:p>
