     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Accépit ergo * Jesus panes, et, cum grátias egísset, distríbuit discumbéntibus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus, therefore, took * the loaves, and when he had given thanks, he distributed to them that were set down.</text:p>
