     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 1. </text:span>Behold, O Lord, * my affliction, because the enemy is lifted up.</text:p>
