   <table:table table:name="Table510" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 2. </text:span>In tribulatióne * invocávi Dóminum, et exaudívit me in latitúdine.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 2. </text:span>In my trouble * I called upon the Lord: and the Lord heard me, and enlarged me.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 3. </text:span>Judicásti, Dómine, * causam ánimæ meæ, defensor vitæ meæ, Dómine Deus meus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 3. </text:span>Thou hast judged, O Lord, * the cause of my soul, thou the Redeemer of my life.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 4. </text:span>Pópule meus, * quid feci tibi, aut quid moléstus fui? Respónde mihi.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 4. </text:span>O my people, * what have I done to thee, or in what have I molested thee? Answer thou me.</text:p>
     </table:table-cell>
    </table:table-row>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 5. </text:span>Numquid rédditur * pro bono malum, quia fodérunt fóveam ánimæ meæ.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>Shall evil be rendered * for good, because they have digged a pit for my soul?</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Hymn as in Ordinary of Passiontide.</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 8:49</text:p>
   <table:table table:name="Table511" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dicébat Jesus * turbis Judæórum, et princípibus sacerdótum: Qui ex Deo est, verba Dei audit: proptérea vos non áuditis, quia ex Deo non estis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus said * to the multitude of the Jews and to the chief priests: “He that is of God, heareth the words of God. Therefore you hear them not, because you are not of God.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Primam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Jn 8:48</text:p>
   <table:table table:name="Table512" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego dæmónium non hábeo, * sed honorífico Patrem meum, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“I have not a devil: * but I honour my Father,” says the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Tértiam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Jn 8:49</text:p>
   <table:table table:name="Table513" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego glóriam meam * non quæro: est qui quæret, et júdicet.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I seek not * my own glory: there is one that seeketh and judgeth.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Passiontide.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Sextam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Jn 8:51</text:p>
   <table:table table:name="Table514" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Amen, amen, dico vobis: * si quis sermónem meum serváverit, mortem non gustábit in ætérnum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Amen, amen, I say to you: * If any man keep my word, he shall not see death for ever.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Heb. 9:13-14</text:p>
   <table:table table:name="Table515" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">SI ENIM sanguis hircórum, et taurórum, et cinis vítulæ aspérsus inquinátos sanctíficat ad emundatiónem carnis: quanto magis sanguis Christi, qui per Spíritum Sanctum semetípsum óbtulit immaculátum Deo, emundábit consciéntiam nostram ab opéribus mórtuis, ad serviéndum Deo vivénti?</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">FOR IF the blood of goats and of oxen, and the ashes of an heifer being sprinkled, sanctify such as are defiled, to the cleansing of the flesh: How much more shall the blood of Christ, who by the Holy Ghost offered himself unspotted unto God, cleanse our conscience from dead works, to serve the living God?</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Passiontide.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Nonam</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Jn 8:59</text:p>
   <table:table table:name="Table516" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tulérunt lápides * Judæi ut jácerent in eum: Jesus autem abscóndit se, et exívit de templo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Jews took up stones * to cast at him, but Jesus hid himself, and went out of the temple.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Little Chapter</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Heb. 9:15</text:p>
   <table:table table:name="Table517" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ET ÍDEO novi testaménti mediátor est: ut, morte intercedénte, in redemptiónem eárum prævaricatiónum, quæ erant sub prióri testaménto, repromissiónem accípiant, qui vocáti sunt ætérnæ hereditátis in Christo Jesu, Dómino nostro.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">AND therefore he is the mediator of the new testament: that by means of his death, for the redemption of those transgressions, which were under the former testament, they that are called may receive the promise of eternal inheritance, in Christ Jesus our Lord.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Brief Respond as in Ordinary of Passiontide.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Rubric">Antiphons and psalms as in Sunday Vespers</text:p>
   <text:p text:style-name="Rubric">Little Chapter as in I Vespers.</text:p>
   <text:p text:style-name="Rubric">Hymn as in Ordinary of Passiontide.</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 8:56</text:p>
   <table:table table:name="Table518" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Abraham pater vester * exsultávit ut vidéret diem meum: vidit, et gavísus est.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Abraham, your father * rejoiced that he might see my day: he saw it, and was glad.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Secunda</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 7:37</text:p>
   <table:table table:name="Table519" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>In die magno * festivitátis stabat Jesus, et clamábat dicens: Si quis sitit, véniat ad me, et bibat.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>On the great day * of the festivity, Jesus stood and cried, saying: “If any man thirst, let him come to me, and drink.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table520" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">SANCTÍFICA, quæsumus, Dómine, nostra jejúnia: et cunctárum nobis indulgéntiam propítius largíre culpárum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">HALLOW, we beseech thee, O Lord, this our Fast, and mercifully grant us forgiveness of all our trespasses. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 7:37</text:p>
   <table:table table:name="Table521" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Si quis sitit, * véniat ad me, et bibat: et de ventre ejus fluent aquæ vivæ, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>“If any man thirst, * let him come to me, and drink, and out of his belly shall flow rivers of living water., ” says the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table522" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA, QUÆSUMUS, Dómine, pópulo tuo salútem mentis et córporis: ut bonis opéribus inhæréndo, tua semper mereátur protectióne defendi. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT unto thy people, we beseech thee, O Lord, health both of mind and body, that they, ever cleaving unto good works may under thy shadow be ever worthily defended. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Tertia</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 7:6</text:p>
   <table:table table:name="Table523" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tempus meum * nondum advénit, tempus autem vestrum semper est parátum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>My time * is not yet come; but your time is always ready.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table524" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">NOSTRA tibi, Dómine, quæsumus, sint accépta jejúnia: quæ nos et expiándo, grátia tua dignos effíciant, et ad remédia perdúcant ætérna. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O LORD, we beseech thee, that this our Fast may be acceptable in thy sight, and may, through thy blessing, effectually work in us, making us meet here to receive thy grace and hereafter the everlasting glory which thou hast promised. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 7:8</text:p>
   <table:table table:name="Table525" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Vos ascéndite * ad diem festum hunc: ego autem non ascéndam, quia tempus meum nondum advénit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Go you up * to this festival day, but I go not up to this festival day: because my time is not accomplished.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table526" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA NOBIS, quæsumus, Dómine, perseverántem in tua voluntáte famulátum: ut in diébus nostris et mérito et número pópulus tibi sérviens augeátur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O LORD, we beseech thee to give us grace to endure to the end in doing thy will, that in our days thy people which serve thee may have increase, both as touching bettering of their works, and multiplying of their numbers. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quarta</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 10:27</text:p>
   <table:table table:name="Table527" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Oves meæ * vocem meam áudiunt: et ego Dóminus agnósco eas.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>My sheep * hear my voice: and I, the Lord, know them.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table528" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">SANCTIFICÁTO hoc jejúnio Deus, tuórum corda fidélium miserátor illústra: et, quibus devotiónis præstas afféctum, præbe supplicántibus pium benígnus audítum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, be mercifully pleased, through the hallowing of this Fast, to shed light upon the hearts of thy faithful people, and since thou hast given them the mind to pray, let thy pitiful ears be opened graciously to hear their supplications. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 10:32</text:p>
   <table:table table:name="Table529" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Multa bona ópera * operátus sum vobis: propter quod opus vultis me occídere?</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Many good works * I have shewed you; for which of these works do you stone me?</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table530" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ADESTO supplicatiónibus nostris, omnípotens Deus: et, quibus fidúciam sperándæ pietátis indúlges, consuétæ misericórdiæ tríbue benígnus efféctum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRACIOUSLY hear our prayers, O Almighty God, and as thou dost give us to look with confidence for thy favour, so grant us in thy goodness the manifestation of thine accustomed mercy. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quinta</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 26:18</text:p>
   <table:table table:name="Table531" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Magíster dicit: * Tempus meum prope est, apud te fácio Pascha cum discípulis meis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The master saith: “My time is near at hand, with thee I make the pasch with my disciples.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table532" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut dígnitas conditiónis humánæ per immoderántiam sauciáta, medicinális parsimóniæ stúdio reformétur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God, that the honour of man’s nature, which gluttony hath degraded, may be seasonably renewed by strictness in keeping this healthful fast. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 22:15</text:p>
   <table:table table:name="Table533" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Desidério desiderávi * hoc Pascha manducáre vobíscum, ántequam pátiar.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>With desire I have desired * to eat this pasch with you, before I suffer.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table534" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ESTO, quæsumus, Dómine, propítius plebi tuæ: ut, quæ tibi non placent, respuéntes, tuórum pótius repleántur delectatiónibus mandatórum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O LORD, we beseech thee, deal mercifully with thy people, and fill plentifully with the rich things of thy commandments all them who, according to thy will, do at this time turn away from that which displeaseth thee. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Sexta</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 22:1</text:p>
   <table:table table:name="Table535" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Appropinquábat autem * dies festus Judæórum: et quærébant príncipes sacerdótum quómodo Jesum interfícerent, sed timébant plebem.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Now the feast of the Jews * was at hand, And the chief priests sought how they might put Jesus to death: but they feared the people.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table536" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CÓRDIBUS nostris, quæsumus, Dómine, grátiam tuam benígnus infúnde: ut peccáta nostra castigatióne voluntária cohibéntes, temporáliter pótius macerémur, quam supplíciis deputémur ætérnis. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">POUR forth thy grace into our hearts, we beseech thee, O Lord, that all who of our own will do check our sins with the curb of mortification, may suffer here, and escape condemnation to eternal punishment hereafter. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 26:4</text:p>
   <table:table table:name="Table537" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Príncipes sacerdótum * consílium fecérunt ut Jesum occíderent: dicébant autem: Non in die festo, ne forte tumúltus fíeret in pópulo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The chief priests * consulted that they might kill Jesus; but they said: “Not on the festival day, lest perhaps there should be a tumult among the people.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table538" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CONCÉDE, quæsumus, omnípotens Deus: ut, qui protectiónis tuæ grátiam quærimus, liberáti a malis ómnibus, secúra tibi mente serviámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God, that we who seek the grace of thy protection, being delivered from all evils, may serve thee ever in peace and quietness of spirit. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Sabbato</text:p>
   <text:p text:style-name="Head3">III classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 17:5</text:p>
   <table:table table:name="Table539" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
