     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Glorify me, O Father, * with thyself, with the glory which I had, before the world was, with thee.</text:p>
