     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PROFÍCIAT, quæsumus, Dómine, plebs tibi dicáta, piæ devotiónis afféctu: ut sacris actiónibus erudíta, quanto majestáti tuæ fit grátior, tanto donis potióribus augeátur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, O Lord, we beseech thee, that thy hallowed people may grow ever in godly love toward thee, and so be instructed by holy works; and being more and more pleasing in thy sight, may they ever receive more and more of thy gifts. Through our Lord.</text:p>
