     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 2. </text:span>Surrounding me; * they compassed me about: and in the name of the Lord I have been revenged on them.</text:p>
