    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 3. </text:span>Júdica causam meam: * defénde, quia potens es, Dómine.</text:p>
