     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 5. </text:span>Let them be confounded * that persecute me, and let not me be confounded, O Lord, my God.</text:p>
