      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Invocábo * nomen tuum, Dómine: ne avértas fáciem tuam a clamóre meo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I will call upon * thy name, O Lord: hide not thy face at my cry.</text:p>
