     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Before the festival day * of the pasch, Jesus knowing that his hour was come, having loved his own, he loved them unto the end.</text:p>
     </table:table-cell>
    </table:table-row>
