    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table561" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">TUA nos misericórdia, Deus, et ab omni subreptióne vetustátis expúrget: et capáces sanctæ novitátis effíciat. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">MAY thy mercy, O God, cleanse us from the deceits of our old nature, and enable us to be formed anew unto holiness. Through our Lord.</text:p>
