   <text:p text:style-name="Head1">Feria Quinta in Cena Domini</text:p>
   <text:p text:style-name="Head2">I classis</text:p>
   <text:p text:style-name="Rubric">From Matins of this feria up until Compline of Holy Saturday, at all the Hours, the <text:span text:style-name="NonRubric">Glória Patri</text:span> is omitted at the end of the psalms.</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Rubric">Lauds are begun immediately from the first antiphon. <text:s/>The psalms and proper antiphons are given in Thursday Lauds II of the Psalter.</text:p>
   <text:p text:style-name="Rubric">The little chapter and hymn are not said.</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Ps 40:10</text:p>
   <table:table table:name="Table566" table:style-name="TableParallel">
