     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">V. </text:span>Homo pacis meæ, in quo sperávi.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Qui edébat panes meos, ampliávit advérsum me supplantatiónem.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">V. </text:span>The man of peace, in whom I trusted</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Who ate my bread, hath greatly supplanted me.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 26:48</text:p>
