    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tráditor autem * dedit eis signum, dicens: Quem osculátus fúero, ipse est, tenéte eum.</text:p>
