     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And he that betrayed him * gave them a sign, saying: “Whomsoever I shall kiss, that is he, hold him fast.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">By this time all the candles on the triangular candlestick have been put out, except the one at the top, and, while the Song of Zacharias is being sung, every light throughout the Church is put out, as are also the six on the Altar, one by one, so that the last is put out at the last verse.</text:p>
	<text:p text:style-name="RubricH">The antiphon having been repeated after the <text:span text:style-name="NonRubric">Benedictus</text:span>, there is said, kneeling:</text:p>
	<text:p text:style-name="RubricHidden"><text:tab/>Phil 2:8</text:p>
   <table:table table:name="Table568" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Christus factus est pro nobis obédiens usque ad mortem.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Christ became obedient unto death for us.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH">And when this is finished, the whole of the <text:span text:style-name="NonRubric">Pater</text:span> is said silently; then in a loud voice, without <text:span text:style-name="NonRubric">Orémus</text:span>, there is said:</text:p>
   <table:table table:name="Table569" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">RÉSPICE, quæsumus, Dómine, super hanc famíliam tuam, pro qua Dóminus noster Jesus Christus non dubitávit mánibus tradi nocéntium, et crucis subíre torméntum.</text:p>
      <text:p text:style-name="Rubric">Et sub silentio concluditur:</text:p>
      <text:p text:style-name="BodyL">Qui tecum vivit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LOOK down, we beseech thee, O Lord, on this thy family, for which our Lord Jesus Christ did not hesitate to be delivered up into the hands of wicked men, and to suffer the torment of the Cross.</text:p>
      <text:p text:style-name="Rubric">The conclusion is said silently:</text:p>
      <text:p text:style-name="BodyE">Who liveth.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Then all arise and depart in silence.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Horas</text:p>
   <text:p text:style-name="Rubric">The Little Hours are said at a suitable hour, with the candles extinguished and without chant. </text:p>
   <text:p text:style-name="Rubric">They are begun immediately from the psalms, which will be of Sunday, but at Prime as on feasts.</text:p>
   <text:p text:style-name="RubricH">After the psalms have been finished, there is said kneeling the antiphon:</text:p>
   <table:table table:name="Table570" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Christus factus est pro nobis obédiens usque ad mortem.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Christ became obedient unto death for us.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">And the rest as in the conclusion of Lauds.</text:p>
   <text:p text:style-name="Rubric">At Prime, the Martyrology is not read, and all the rest up to the end of the Hour is not said.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Rubric">Vespers are not said today by those who are present at the evening Mass of the Lord’s Supper.</text:p>
   <text:p text:style-name="RubricH">They are begun immediately from the first antiphon:</text:p>
