     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant 1. </text:span>Cálicem * salutáris accípiam, et nomen Dómini invocábo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant 1. </text:span>I will take the chalice of salvation; * and I will call upon the name of the Lord.</text:p>
