    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">And the rest as in the conclusion of Lauds.</text:p>
   <text:p text:style-name="Rubric">At Prime, the Martyrology is not read, and all the rest up to the end of the Hour is not said.</text:p>
