   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Passiontide</text:p>
   <text:p text:style-name="Hidden2">Holy Saturday</text:p>
   <text:p text:style-name="Head1">Sabbato Sancto</text:p>
   <text:p text:style-name="Head2">I classis</text:p>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Rubric">Lauds are begun immediately from the first antiphon. <text:s/>The psalms and proper antiphons are given in Saturday Lauds II of the Psalter.</text:p>
   <text:p text:style-name="RubricH">The little chapter and hymn are not said.</text:p>
	<text:p text:style-name="RubricHidden"><text:tab/>Ps 15:9</text:p>
   <table:table table:name="Table584" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">V. </text:span>Caro mea requiéscet in spe.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Et nec dabis sanctum tuum vidére corruptiónem.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">V. </text:span>My flesh shall rest in hope.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>And nor wilt then give thy holy one to see corruption.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <table:table table:name="Table585" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Mulíeres * sedéntes ad monuméntum lamentabántur, flentes Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>There were women * sitting over against the sepulchre, weeping, and making lamentation for the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
	<text:p text:style-name="RubricH">The antiphon having been repeated after the <text:span text:style-name="NonRubric">Benedictus</text:span>, there is said, kneeling:</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Phil 2:8</text:p>
   <table:table table:name="Table586" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Christus factus est pro nobis obédiens usque ad mortem, mortem autem crucis: propter quod et Deus exaltávit illum, et dedit illi nomen, quod est super omne nomen.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Christ became obedient unto death for us, even to the death of the cross. For which cause God also hath exalted him, and hath given him a name which is above all names.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH">And when this is finished, the whole of the <text:span text:style-name="NonRubric">Pater </text:span>is said silently; then in a loud voice, without <text:span text:style-name="NonRubric">Orémus</text:span>, there is said:</text:p>
   <table:table table:name="Table587" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CONCÉDE, quæsumus, omnípotens Deus: ut, qui Fílii tui resurrectiónem devóta exspectatióne prævenímus; ejúsdem resurrectiónis glóriam consequámur.</text:p>
      <text:p text:style-name="Rubric">Et sub silentio concluditur:</text:p>
      <text:p text:style-name="BodyL">Per eúndem Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God: that we who anticipate the resurrection of thy Son with pious expectation, may obtain the glory of the same resurrection.</text:p>
      <text:p text:style-name="Rubric">The conclusion is said silently:</text:p>
      <text:p text:style-name="BodyE">Through the same.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">Then all arise and depart in silence.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Horas</text:p>
   <text:p text:style-name="Rubric">The Little Hours are said at a suitable hour, with the candles extinguished and without chant. </text:p>
   <text:p text:style-name="Rubric">They are begun immediately from the psalms, which will be of Sunday, but at Prime as on feasts.</text:p>
   <text:p text:style-name="RubricH">After the psalms have been finished, there is said kneeling the antiphon:</text:p>
   <table:table table:name="Table588" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Christus factus est pro nobis obédiens usque ad mortem, mortem autem crucis: propter quod et Deus exaltávit illum, et dedit illi nomen, quod est super omne nomen.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Christ became obedient unto death for us, even to the death of the cross. For which cause God also hath exalted him, and hath given him a name which is above all names.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">And the rest as in the conclusion of Lauds.</text:p>
   <text:p text:style-name="Rubric">At Prime, the Martyrology is not read, and all the rest up to the end of the Hour is not said.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Vésperas</text:p>
   <text:p text:style-name="Rubric">Vespers are said after noon, at a suitable hour, with the candles extinguished and without chant.</text:p>
   <text:p text:style-name="Rubric">They are begun immediately from the first antiphon.</text:p>
