    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH">The antiphon having been repeated after the <text:span text:style-name="NonRubric">Magnificat</text:span>, the following is said immediately:</text:p>
   <table:table table:name="Table600" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CONCÉDE, quæsumus, omnípotens Deus: ut, qui Fílii tui resurrectiónem devóta exspectatióne prævenímus; ejúsdem resurrectiónis glóriam consequámur.</text:p>
      <text:p text:style-name="Rubric">Et sub silentio concluditur:</text:p>
      <text:p text:style-name="BodyL">Per eúndem Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Almighty God: that we who anticipate the resurrection of thy Son with pious expectation, may obtain the glory of the same resurrection.</text:p>
      <text:p text:style-name="Rubric">The conclusion is said silently:</text:p>
      <text:p text:style-name="BodyE">Through the same.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Rubric">And thus Vespers are terminated. Before the Mass of the Paschal Vigil, Passiontide ends, and from the beginning of this same Mass, Paschaltide starts.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Completorium</text:p>
   <text:p text:style-name="Rubric">Compline is said only by those who are not present at the solemn Paschal Vigil.</text:p>
	<text:p text:style-name="Body"/>
   <text:p text:style-name="RubricH">Examination of Conscience, followed by:</text:p>
   <text:p text:style-name="Body">Confíteor. Miserátur. Indulgéntiam.</text:p>
