   <text:p text:style-name="Rubric">After the psalms, the <text:span text:style-name="NonRubric">Nunc dimittis </text:span>is said immediately, without antiphon.</text:p>
   <text:p text:style-name="RubricH">And when this is finished, the whole of the <text:span text:style-name="NonRubric">Pater </text:span>is said silently; then in a loud voice, without <text:span text:style-name="NonRubric">Orémus</text:span>, there is said:</text:p>
   <table:table table:name="Table601" table:style-name="TableParallel">
