   <text:p text:style-name="Head2">Pro Laudibus</text:p>
   <text:p text:style-name="RubricH">Since the celebration of the solemn Paschal vigil takes the place of the night Office of Easter Sunday, Matins of the same Easter Sunday are omitted, and in place of Lauds, within the Mass of the vigil after the Communion, there is sung:</text:p>
