   <text:p text:style-name="Head2">ad Completórium</text:p>
   <text:p text:style-name="Rubric">The hour is begun as in the Ordinary.</text:p>
   <text:p text:style-name="Rubric">The psalms of Sunday are said without antiphon. </text:p>
   <text:p text:style-name="RubricH">After the conclusion of the psalms, the following antiphon is said:</text:p>
