      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Alleluia, alleluia, alleluia, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="RubricH">The <text:span text:style-name="NonRubric">Nunc Dimittis </text:span>is then said without antiphon, and is followed by:</text:p>
