   <text:p text:style-name="Head2">INFRA OCTAVAM PASCHÆ</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table626" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui diversitátem Géntium in confessióne tui nóminis adunásti: da, ut renátis fonte baptísmatis una sit fides méntium, et píetas actiónum. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, who united the various nations in the confession of thy name, grant that, born again in the waters of Baptism, they may be one by faith in mind, and by love in deed. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
