      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tulérunt Dóminum meum, * et néscio ubi posuérunt eum: si tu sustulísti eum, dícito mihi, allelúja: et ego eum tollam, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>They have taken away my Lord; and I know not where they have laid him: if thou hast taken him hence, tell me, alleluia: and I will take him away, alleluia.</text:p>
