      <text:p text:style-name="BodyLDrop">CONCÉDE, quæsumus, omnípotens Deus: ut, qui festa paschália venerándo égimus, per hæc contíngere ad gáudia ætérna mereámur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, almighty God, that we, who have reverently celebrated the Easter solemnities, may, by them, deserve to arrive at everlasting joys. Through our Lord.</text:p>
