      <text:p text:style-name="BodyEDrop">WHO is he that overcometh the world, but he that believeth that Jesus is the Son of God? This is he that came by water and blood, Jesus Christ: not by water only, but by water and blood.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
