     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">SI TESTIMÓNIUM hóminum accípimus, testimónium Dei majus est: quóniam hoc est testimónium Dei, quod majus est, quóniam testificátus est de Fílio suo. Qui credit in Fílium Dei, habet testimónium Dei in se.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>Deo grátias.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">IF WE receive the testimony of men, the testimony of God is greater. For this is the testimony of God, which is greater, because he hath testified of his Son. He that believeth in the Son of God, hath the testimony of God in himself.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Thanks be to God.</text:p>
