    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Pétite, et accipiétis: * quærite, et inveniétis: pulsáte, et aperiétur vobis, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Ask, and you shall receive: * seek, and you shall find: knock, and it shall be opened to you, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
