    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Exívi a Patre, * et veni in mundum: íterum relínquo mundum, et vado ad Patrem, allelúja.</text:p>
