   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Body"><text:span text:style-name="Rubric">Within the Octave all is said as on the Feast, except those things which are assigned as proper for the respective days.</text:span></text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Secunda</text:p>
   <text:p text:style-name="Head2">INFRA OCTAVAM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table752" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui Apóstolis tuis Sanctum dedísti Spíritum: concéde plebi tuæ piæ petitiónis efféctum; ut, quibus dedísti fidem, largiáris et pacem. Per Dóminum... in unitáte ejúsdem Spíritus Sancti.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, who gave the Holy Spirit to thy Apostles, grant to thy people the effect of their devout prayers, that on those who whom you have given faith, you may also bestow peace. Through our Lord...in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 3:16</text:p>
   <table:table table:name="Table753" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Sic Deus * diléxit mundum, ut Fílium suum unigénitum daret: ut omnis, qui credit in ipsum, non péreat, sed hábeat vitam ætérnam, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>God so * loved the world, as to give his only begotten Son; that whosoever believeth in him, may not perish, but may have life everlasting, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 14:23</text:p>
   <table:table table:name="Table754" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Si quis díligit me, * sermónem meum servábit; et Pater meus díliget eum, et ad eum veniémus, et mansiónem apud eum faciémus, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>If any one love me, * he will keep my word, and my Father will love him, and we will come to him, and will make our abode with him, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Tertia</text:p>
   <text:p text:style-name="Head2">INFRA OCTAVAM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table755" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ADSIT nobis, quæsumus, Dómine, virtus Spíritus Sancti: quæ et corda nostra cleménter expúrget, et ab ómnibus tueátur advérsis. Per Dóminum... in unitáte ejúsdem Spíritus Sancti.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, O Lord, let the power of the Holy Spirit be always with us; let it mercifully purify our hearts, and safeguard us from all harm. Through our Lord...in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 10:9</text:p>
   <table:table table:name="Table756" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego sum óstium, * dicit Dóminus: per me si quis introíerit, salvábitur, et páscua invéniet, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I am the door, * saith the Lord: By me, if any man enter in, he shall be saved: and he shall go in, and go out, and shall find pastures, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 14:27</text:p>
   <table:table table:name="Table757" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Pacem * relínquo vobis, pacem meam do vobis: non quómodo mundus dat, ego do vobis, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Peace * I leave with you, my peace I give unto you: not as the world giveth, do I give unto you, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quarta</text:p>
   <text:p text:style-name="Head2">QUATUOR TEMPORUM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table758" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">MENTES nostras, quæsumus, Dómine, Paráclitus, qui a te procédit, illúminet: et indúcat in omnem, sicut tuus promísit Fílius, veritátem: Qui tecum vivit et regnat in unitáte ejúsdem Spíritus Sancti Deus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">MAY the Comforter, who proceeds from thee, enlighten our minds, we beseech thee, O Lord, and guide us, as thy Son has promised, into all truth. who with thee lives and reigns in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 6:51</text:p>
   <table:table table:name="Table759" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego sum panis vivus, * dicit Dóminus, qui de cælo descéndi, allelúja, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I am the living bread, * saith the Lord, which came down from heaven, alleluia, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 6:51-52</text:p>
   <table:table table:name="Table760" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego sum panis vivus, * dicit Dóminus, qui de cælo descéndi: si quis manducáverit ex hoc pane, vivet in ætérnum: et panis, quem ego dabo, caro mea est pro mundi vita, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I am the living bread, * saith the Lord, which came down from heaven: If any man eat of this bread, he shall live for ever; and the bread that I will give, is my flesh, for the life of the world, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Quinta</text:p>
   <text:p text:style-name="Head2">INFRA OCTAVAM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table761" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui hodiérna die corda fidélium Sancti Spíritus illustratióne docuísti: da nobis in eódem Spíritu recta sápere; et de ejus semper consolatióne gaudére. Per Dóminum... in unitáte ejúsdem Spíritus Sancti Deus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, who on this day by the light of the Holy Spirit taught the hearts of the faithful, grant us by the same Spirit to relish what is right, and always to rejoice in his comfort. Through our Lord...in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 9:1-2</text:p>
   <table:table table:name="Table762" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Convocátis Jesus * duódecim discípulis suis, dedit illis virtútem et potestátem super ómnia dæmónia, et ut languóres curárent: et misit illos prædicáre regnum Dei, et sanáre infírmos, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus, calling together * the twelve apostles, gave them power and authority over all devils, and to cure diseases: And he sent them to preach the kingdom of God, and to heal the sick, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 15:26</text:p>
   <table:table table:name="Table763" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Spíritus, * qui a Patre procédit, allelúja: ille me clarificábit, allelúja, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Spirit, * who proceedeth from the Father, alleluia: he shall give testimony of me, alleluia, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Feria Sexta</text:p>
   <text:p text:style-name="Head2">QUATUOR TEMPORUM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table764" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA, QUÆSUMUS, Ecclésiæ tuæ, miséricors Deus: ut Sancto Spíritu congregáta, hostíli nullátenus incursióne turbétur. Per Dóminum... in unitáte ejúsdem Spíritus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT to thy Church, we beseech thee, O merciful God, that, being gathered together in the Holy Spirit, she may in no way be troubled by any hostile attacks. Through our Lord...in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 5:24</text:p>
   <table:table table:name="Table765" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dixit Jesus: * Ut sciátis autem quia Fílius hóminis habet potestátem in terra dimitténdi peccáta, ait paralytico: Tibi dico, surge: tolle lectum tuum, et vade in domum tuam, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus said: * But that you may know that the Son of man hath power on earth to forgive sins, he saith to the sick of the palsy, I say to thee, Arise, take up thy bed, and go into thy house, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 14:26</text:p>
   <table:table table:name="Table766" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Paráclitus autem * Spíritus Sanctus, quem mittet Pater in nómine meo, ille vos docébit ómnia, et súggeret vobis ómnia, quæcúmque díxero vobis, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But the Paraclete, * the Holy Ghost, whom the Father will send in my name, he will teach you all things, and bring all things to your mind, whatsoever I shall have said to you, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1NI">Sabbato</text:p>
   <text:p text:style-name="Head2">QUATUOR TEMPORUM PENTECOSTES</text:p>
   <text:p text:style-name="Head3">I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table767" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">MÉNTIBUS nostris, quæsumus, Dómine, Spíritum Sanctum benígnus infúnde: cujus et sapiéntia cónditi sumus, et providéntia gubernámur. Per Dóminum... in unitáte ejúsdem Spíritus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">DEIGN, we beseech thee, O Lord, to pour forth thy Holy Spirit into our souls, by whose wisdom we were created, and by whose providence we are governed. Through our Lord...in the unity of the same Holy Spirit.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head2">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Rom 5:5</text:p>
   <table:table table:name="Table768" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cáritas Dei * diffúsa est in córdibus nostris, per inhabitántem Spíritum ejus in nobis, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The charity of God * is poured forth in our hearts, by the Holy Ghost, who is given to us, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Body"><text:span text:style-name="Rubric">After None, the proper Office of the Octave ends, and Paschaltide is finished.</text:span></text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics102" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Head0">Tempus Per Annum</text:p>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics103" text:anchor-type="as-char" svg:width="3.4201in" style:rel-width="100%" svg:height="0.6201in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Trinity Sunday</text:p>
   <text:p text:style-name="Head1">in Festo Sanctissimæ Trinitatis</text:p>
   <text:p text:style-name="Head2">Dominica I Post Pentecosten - I classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table769" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, qui dedísti fámulis tuis in confessióne veræ fídei, ætérnæ Trinitátis glóriam agnóscere, et in poténtia majestátis adoráre Unitátem: quæsumus; ut ejúsdem fídei firmitáte, ab ómnibus semper muniámur advérsis. Per Dóminum.</text:p>
     </table:table-cell>
