   <text:p text:style-name="Head2">Dominica I Post Pentecosten</text:p>
   <text:p text:style-name="RubricH">The First Sunday after Pentecost is completely replaced by Trinity Sunday; no commemoration of the Sunday is observed. However, in the ferial Office of the week following Trinity Sunday, the prayer of the First Sunday after Pentecost is used:</text:p>
   <table:table table:name="Table788" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, in te sperántium fortitúdo, adésto propítius invocatiónibus nostris: et quia sine te nihil potest mortális infírmitas, præsta auxílium grátiæ tuæ; ut in exsequéndis mandátis tuis, et voluntáte tibi et actióne placeámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, the strength of them that hope in thee, graciously give ear to our prayers; and since human infirmity without thee can do nothing, grant us the help of thy grace, that, in fulfilling thy commandments, we may please thee both in will and deed. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
