    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">V. </text:span>Hauriétis aquas in gáudio.</text:p>
      <text:p text:style-name="BodyL"><text:span text:style-name="VR">R. </text:span>De fóntibus Salvatóris.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">V. </text:span>You shall draw waters with joy.</text:p>
      <text:p text:style-name="BodyE"><text:span text:style-name="VR">R. </text:span>Out of the Saviour’s fountains.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 19:33-34</text:p>
   <table:table table:name="Table848" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ad Jesum autem * cum veníssent, ut vidérunt eum jam mórtuum, non fregérunt ejus crura, sed unus mílitum láncea latus ejus apéruit et contínuo exívit sanguis et aqua.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But after they were come to Jesus, * when they saw that he was already dead, they did not break his legs. But one of the soldiers with a spear opened his side, and immediately there came out blood and water.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Compline taken from Sunday.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics109" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Third Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica III Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table849" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PROTÉCTOR in te sperántium, Deus, sine quo nihil est válidum, nihil sanctum; multíplica super nos misericórdiam tuam; ut, te rectóre, te duce, sic transeámus per bona temporália, ut non amittámus ætérna. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, the Protector of those who hope in thee, without whom nothing is strong, nothing holy: multiply upon us thy mercy, that with thee as our ruler and guide, we may so pass through temporal things, as not to lose those which are eternal. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Sam 3:20</text:p>
   <table:table table:name="Table850" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cognovérunt omnes * a Dan usque Bersabée, quod fidélis Sámuel prophéta esset Dómini.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And all * from Dan to Bersabee, knew that Samuel was a faithful prophet of the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 15:4</text:p>
   <table:table table:name="Table851" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quis ex vobis * homo, qui habet centum oves et, si perdíderit unam ex illis, nonne dimíttit nonagínta novem in desérto et vadit ad illam quæ períerat, donec invéniat eam? allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>What man of you * that hath an hundred sheep: and if he shall lose one of them, doth he not leave the ninety-nine in the desert, and go after that which was lost, until he find it? Alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 15:8</text:p>
   <table:table table:name="Table852" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quæ múlier * habens drachmas decem, et si perdíderit drachmam unam, nonne accéndit lucérnam et evérrit domum et quærit diligénter, donec invéniat?</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Or what woman * having ten groats; if she lose one groat, doth not light a candle, and sweep the house, and seek diligently until she find it?</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics110" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fourth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica IV Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table853" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA NOBIS, quæsumus, Dómine: ut et mundi cursus pacífice nobis tuo órdine dirigátur; et Ecclésia tua tranquílla devotióne lætétur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, O Lord, that the course of the world may, by thy governance, be peaceably ordered for us, and that thy Church may rejoice in quiet devotion. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Sam 17:50</text:p>
   <table:table table:name="Table854" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Præváluit David * in Philisthæum in funda et lápide in nómine Dómini.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>David prevailed * over the Philistine, with a sling and a stone, in the Name of the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 5:3</text:p>
   <table:table table:name="Table855" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ascéndens Jesus * in navim et sedens docébat turbas, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus went into * the ship, and sitting he taught the crowd, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 5:5</text:p>
   <table:table table:name="Table856" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Præcéptor, * per totam noctem laborántes nihil cépimus; in verbo autem tuo laxábo rete.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Master, we have labored all the night, and have taken nothing: but at thy word I will let down the net.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics111" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fifth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica V Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table857" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui diligéntibus te bona invisibília præparásti: infúnde córdibus nostris tui amóris afféctum; ut te in ómnibus et super ómnia diligéntes, promissiónes tuas, quæ omne desidérium súperant, consequámur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, you have prepared invisible good things for those who love thee; pour into our hearts an ardent love of thee, that loving thee in all things, and above all things, we may obtain thy promises, which exceed all that we can desire. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Sam 1:21,25,23</text:p>
   <table:table table:name="Table858" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Montes Gelboë, * nec ros nec plúvia véniant super vos: quia in te abjéctus est clypeus fórtium, clypeus Saul, quasi non esset unctus óleo. Quómodo cecidérunt fortes in bello? Jónathas in excélsis interféctus est: Saul et Jónathas, amábiles et decóri valde in vita sua, in morte quoque non sunt divísi.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Ye mountains of Gelboe, * let neither dew, nor rain come upon you: for in thee was cast away the shield of the valiant, the shield of Saul as though he had not been anointed with oil. How are the valiant fallen in battle? Jonathan slain in the high places? Saul and Jonathan, lovely, and comely in their life, even in death they were not divided.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 5:21</text:p>
   <table:table table:name="Table859" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Audístis * quia dictum est antíquis: Non occídes; qui autem occíderit, reus erit judício.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>You have heard * that it was said to them of old: Thou shalt not kill. And whosoever shall kill shall be in danger of the judgment.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 5:23-24</text:p>
   <table:table table:name="Table860" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Si offers * munus tuum ad altáre et recordátus fúeris quia frater tuus habet áliquid advérsus te, relínque ibi munus tuum ante altáre et vade prius reconciliári fratri tuo, et tunc véniens ófferes munus tuum, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>If thou offer * thy gift at the altar, and there thou remember that thy brother hath any thing against thee; leave there thy offering before the altar, and go first to be reconciled to thy brother: and then coming thou shalt offer thy gift, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics112" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sixth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica VI Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table861" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS virtútum, cujus est totum quod est óptimum: ínsere pectóribus nostris amórem tui nóminis, et præsta in nobis religiónis augméntum; ut, quæ sunt bona, nútrias, ac pietátis stúdio, quæ sunt nutríta, custódias. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD of power, to whom belongs all that is perfect, engraft in our hearts the love of thy name, and grant us an increase of religion; that what in us is good, you may nourish, and in thy loving-kindness, preserve in us what you have nourished. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Chron 21:8</text:p>
   <table:table table:name="Table862" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Obsecro, Dómine, * aufer iniquitátem servi tui, quia insipiénter egi.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I beseech thee, O Lord, * take away the iniquity of thy servant, for I have done foolishly.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mk 8:1-2</text:p>
   <table:table table:name="Table863" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum turba multa * esset cum Jesu nec habérent quod manducárent, convocátis discípulis, ait illis: Miséreor super turbam, quia ecce jam tríduo sústinent me nec habent quod mandúcent, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When there was a great multitude * with Jesus, having nothing to eat; calling his disciples together, he saith to them: “I have compassion on the multitude, for behold they have now been with me three days, and have nothing to eat,” alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mk 8:2-3</text:p>
   <table:table table:name="Table864" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Miséreor * super turbam, quia ecce jam tríduo sústinent me nec habent quod mandúcent, et, si dimísero eos jejúnos, defícient in via, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I have compassion on the multitude, for behold they have now been with me three days, and have nothing to eat. And if I shall send them away fasting to their home, they will faint in the way, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics113" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Seventh Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica VII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday occurs in the month of August, the antiphons and lessons are taken from the respective Sunday in the month of August, with the rest of the Books of Kings omitted.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table865" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, cujus providéntia in sui dispositióne non fállitur: te súpplices exorámus; ut nóxia cuncta submóveas, et ómnia nobis profutúra concédas. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, whose providence never fails in what it ordains, we humbly beseech thee to put away from us all things harmful, and to give all things profitable to us. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Kings 1:45</text:p>
   <table:table table:name="Table866" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Unxérunt Salomónem * Sadoc sacérdos et Nathan prophéta, regem in Gihon et ascendéntes læti dixérunt: Vivat rex in ætérnum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Sadoc the priest, * and Nathan the prophet anointed Solomon king in Gihon: and they went up rejoicing, saying: May the king live for ever.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 7:15-16</text:p>
   <table:table table:name="Table867" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Atténdite * a falsis prophétis, qui véniunt ad vos in vestiméntis óvium, intrínsecus autem sunt lupi rapáces; a frúctibus eórum cognoscétis eos, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Beware of false prophets, who come to you in the clothing of sheep, but inwardly they are ravening wolves. By their fruits you shall know them, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 7:18-19</text:p>
   <table:table table:name="Table868" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Non potest arbor * bona fructus malos fácere, nec arbor mala fructus bonos fácere. Omnis arbor quæ non facit fructum bonum, excidétur, et in ignem mittétur, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>A good tree cannot bring forth evil fruit, neither can an evil tree bring forth good fruit. Every tree that bringeth not forth good fruit, shall be cut down, and shall be cast into the fire.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics114" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Eighth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica VIII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday occurs in the month of August, the antiphons and lessons are taken from the respective Sunday in the month of August, with the rest of the Books of Kings omitted.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table869" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">LARGÍRE nobis, quæsumus, Dómine, semper spíritum cogitándi quæ recta sunt, propítius et agéndi: ut, qui sine te esse non póssumus, secúndum te vívere valeámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRACIOUSLY impart to us, we beseech thee, O Lord, the spirit at all times to think and to do the things that are right; that we, who cannot subsist without thee, may be enabled to live according to thy will. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table870" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Exaudísti, Dómine, * oratiónem servi tui, ut ædificárem templum nómini tuo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Thou, O Lord, hast heard * the prayer of thy servant; that I might build a temple to thy name.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 16:2</text:p>
   <table:table table:name="Table871" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ait dóminus víllico: * Quid hoc áudio de te? redde ratiónem villicatiónis tuæ, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Lord said unto his steward: How is it that I hear this of thee? give an account of thy stewardship.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 16:3-4</text:p>
   <table:table table:name="Table872" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quid fáciam, * quia dóminus meus aufert a me villicatiónem? Fódere non váleo, mendicáre erubésco. Scio quid fáciam, ut, cum amótus fúero a villicatióne, recípiant me in domos suas.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>What shall I do, because my lord taketh away from me the  stewardship? To dig I am not able; to beg I am ashamed. I know what I will do, that when I shall be removed from the stewardship, they may receive me into their houses.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics115" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Ninth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica IX Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday occurs in the month of August, the antiphons and lessons are taken from the respective Sunday in the month of August, with the rest of the Books of Kings omitted.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table873" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PÁTEANT aures misericórdiæ tuæ, Dómine, précibus supplicántium: et, ut peténtibus desideráta concédas; fac eos, quæ tibi sunt plácita, postuláre. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LET the ears of thy mercy, O Lord, be open to the prayers of thy suppliants; and that you may grant them what they desire, make them ask the things that are pleasing to thee. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Kings 2:11-12</text:p>
   <table:table table:name="Table874" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dum tólleret Dóminus * Eliam per túrbinem in cælum, Eliséus clamábat: Pater mi, currus Israël, et auríga ejus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When the Lord took up * Elias by a whirlwind into heaven, Eliseus cried: “My father, the chariot of Israel, and the driver thereof.”</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 19:41-44</text:p>
   <table:table table:name="Table875" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum appropinquáret * Dóminus Jerúsalem videns civitátem flevit super illam, et dixit: Quia si cognovísses et tu, quia vénient dies in te, et circúmdabunt te inimíci tui vallo et circúmdabunt te et coangustábunt te úndique et ad terram prostérnent te: eo quod non cognovísti tempus visitatiónis tuæ, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When he drew near, * The Lord, seeing Jerusalem, wept over the city, saying: If thou also hadst known: For the days shall come upon thee, and thy enemies shall cast a trench about thee, and compass thee round, and straiten thee on every side, and beat thee flat to the ground: because thou hast not known the time of thy visitation, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 19:46-47</text:p>
   <table:table table:name="Table876" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Scriptum est enim: * Quia domus mea domus oratiónis est cunctis géntibus; vos autem fecístis illam spelúncam latrónum. Et erat quotídie docens in templo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>It is written: * My house is the house of prayer for all nations; But you have made it a den of thieves. And he was teaching daily in the temple. </text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics116" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Tenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica X Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday occurs in the month of August, the antiphons and lessons are taken from the respective Sunday in the month of August, with the rest of the Books of Kings omitted.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table877" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui omnipoténtiam tuam parcéndo máxime et miserándo maniféstas: multíplica super nos misericórdiam tuam; ut ad tua promíssa curréntes, cæléstium bonórum fácias esse consórtes. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, you manifest thy almighty power most of all in sparing and showing mercy; multiply upon us thy mercy, that we, running to thy promises, may be made partakers of thy heavenly goods. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Kings 12:2</text:p>
   <table:table table:name="Table878" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Fecit Joas * rectum coram Dómino cunctis diébus, quibus dócuit eum Jójada sacérdos.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Joas did * that which was right before the Lord all the days that Joiada the priest taught him.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 18:13</text:p>
   <table:table table:name="Table879" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Stans a longe * publicánus, nolébat óculos ad cælum leváre, sed percutiébat pectus suum dicens: Deus, propítius esto mihi peccatóri.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Standing afar off, * the publican would not so much as lift up his eyes towards heaven; but struck his breast, saying: O god, be merciful to me a sinner.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 18:14</text:p>
   <table:table table:name="Table880" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Descéndit * hic justificátus in domum suam ab illo; quia omnis qui se exáltat, humiliábitur, et, qui se humíliat, exaltábitur.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>This man went down * into his house justified rather that the other: because every one that exalteth himself, shall be humbled: and he that humbleth himself, shall be exalted.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics117" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Eleventh Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XI Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday occurs in the month of August, the antiphons and lessons are taken from the respective Sunday in the month of August, with the rest of the Books of Kings omitted.</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table881" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, qui abundántia pietátis tuæ, et mérita súpplicum excédis et vota: effúnde super nos misericórdiam tuam; ut dimíttas quæ consciéntia métuit, et adjícias quod orátio non præsúmit. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and everlasting God, in the abundance of thy loving-kindness, you exceed both the merits and the desires of thy supplicants; pour forth thy mercy upon us, that you may forgive what our consciences fear and grant what we do not presume to ask. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Kings 20:3</text:p>
   <table:table table:name="Table882" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Obsecro, Dómine: * meménto, quæso, quómodo ambuláverim coram te in veritáte et in corde perfécto et quod plácitum est coram te fécerim.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I beseech thee, O Lord, * remember how I have walked before thee in truth, and with a perfect heart, and have done that which is pleasing before thee.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mk 7:31,37</text:p>
   <table:table table:name="Table883" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum transísset Dóminus * fines Tyri, surdos fecit audíre et mutos loqui.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When the Lord had passed from * the coasts of Tyre, he made both the deaf to hear, and the dumb to speak.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mk 7:37</text:p>
   <table:table table:name="Table884" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Bene ómnia fecit * et surdos fecit audíre et mutos loqui.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>He hath done all things well * he hath made both the deaf to hear, and the dumb to speak.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics118" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"><text:span text:style-name="VR"/></text:p>
   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics119" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6299in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sundays of August</text:p>
   <text:p text:style-name="RubricH">Collect for all hours, and Antiphons for Lauds and II Vespers, are found among the Sundays after Pentecost.</text:p>
   <text:p text:style-name="Head1">Dominica I Augusti</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Prov 9:1</text:p>
   <table:table table:name="Table885" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Sapiéntia * ædificávit sibi domum, excídit colúmnas septem, súbdidit sibi gentes, superbórum et sublímium colla própria virtúte calcávit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Wisdom hath built herself a house, she hath hewn her out seven pillars; she placed the nations under her; and in her strength, the necks of the haughty and proud she hath trodden under foot.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics120" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica II Augusti</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Ecclus 24:7</text:p>
   <table:table table:name="Table886" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ego in altíssimis * hábito: et thronus meus in colúmna nubis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I dwelt in the highest places, and my throne is in a pillar of a cloud.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics121" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica III Augusti</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Ecclus 1:1</text:p>
   <table:table table:name="Table887" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Omnis sapiéntia * a Dómino Deo est, et cum illo fuit semper, et est ante ævum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>All wisdom is from the Lord God, and hath been always with him, and is before all time.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics122" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica IV Augusti</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table888" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Sapiéntia * clámitat in platéis: Si quis díligit sapiéntiam, ad me declínet, et eam invéniet: et, cum invénerit, beátus erit si tenúerit eam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Wisdom * crieth in the streets: If any man love wisdom, let him come unto me, and he shall find her; and once he hath found her, he shall be blessed if he hold her.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics123" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica V Augusti</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If there is no room for this Sunday, it is omitted together with its week.</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Prov 6:20</text:p>
   <table:table table:name="Table889" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Obsérva, fili, * præcépta patris tui, et ne dimíttas legem matris tuæ, sed liga eam semper in corde tuo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>My son, keep * the commandments of thy father, and forsake not the law of thy mother, but bind them always in thine heart.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics124" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"><text:span text:style-name="VR"/></text:p>
   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics125" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6299in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sundays of September</text:p>
   <text:p text:style-name="RubricH">Collect for all hours, and Antiphons for Lauds and II Vespers, are found among the Sundays after Pentecost.</text:p>
   <text:p text:style-name="Head1">Dominica I Septembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Job 2:10</text:p>
   <table:table table:name="Table890" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum audísset Job * nuntiórum verba, sustínuit patiénter, et ait: Si bona suscépimus de manu Dómini, mala autem quare non sustineámus? In ómnibus his non peccávit Job lábiis suis, neque stultum áliquid contra Deum locútus est.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When Job heard * the words of the messengers, he suffered it patiently, and said: If we have received good things at the hand of God, why should we not receive evil? In all these things Job did not sin with his lips, nor speak against God foolishly.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics126" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica II Septembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Job 2:10</text:p>
   <table:table table:name="Table891" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>In ómnibus his * non peccávit Job lábiis suis neque stultum áliquid contra Deum locútus est.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>In all these things * Job did not sin with his lips, nor speak against God foolishly.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics127" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica III Septembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Tob 3:3</text:p>
   <table:table table:name="Table892" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ne reminiscáris, * Dómine, delícta mea vel paréntum meórum, neque vindíctam sumas de peccátis meis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Remember not, * O Lord, my offenses, nor those of my parents, neither take thou revenge of my sins.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics128" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Quarta</text:p>
   <text:p text:style-name="Head3">II classis, Quatuor Temporum Septembris</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table893" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">MISERICÓRDIÆ tuæ remédiis, quæsumus, Dómine, fragílitas nostra subsístat: ut, quæ sua conditióne attéritur, tua cleméntia reparétur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, O Lord, that thy healing mercy may uphold our weakness, so that what of itself is falling into ruin may be restored by thy clemency. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Lauds II is said.</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mk 9:28</text:p>
   <table:table table:name="Table894" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Hoc genus * dæmoniórum in nullo potest exíre, nisi in oratióne et jejúnio.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>This kind * of demon can go out by nothing, but by prayer and fasting.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="Rubric">Antiphon as in <text:span text:style-name="NonRubric">Benedictus </text:span>at Lauds.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics129" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Feria Sexta</text:p>
   <text:p text:style-name="Head3">II classis, Quatuor Temporum Septembris</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds and Vespers.</text:p>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table895" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut observatiónes sacras annua devotióne recoléntes, et córpore tibi placeámus, et mente. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, almighty God, grant that, as year by year, we devoutly keep these sacred fasts, we may please thee both in body and soul. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Lauds II is said.</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 7:37</text:p>
   <table:table table:name="Table896" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Múlier, * quæ erat in civitáte peccátrix, stans retro secus pedes Dómini, lácrimis cœpit rigáre pedes ejus et capíllis cápitis sui tergébat, et deosculabátur pedes ejus et unguénto ungébat.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>A woman * that was in the city, a sinner, standing behind at the feet of the Lord, she began to wash his feet, with tears, and wiped them with the hairs of her head, and affectionately kissed his feet, and anointed them with the ointment.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="Rubric">Antiphon as in <text:span text:style-name="NonRubric">Benedictus </text:span>at Lauds.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics130" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">Sabbato</text:p>
   <text:p text:style-name="Head3">II classis, Quatuor Temporum Septembris</text:p>
   <text:p text:style-name="Rubric">Preces are said at Lauds.</text:p>
   <text:p text:style-name="Head3">Collect</text:p>
   <table:table table:name="Table897" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, qui per continéntiam salutárem corpóribus medéris et méntibus: majestátem tuam súpplices exorámus; ut pia jejunántium deprecatióne placátus, et præséntia nobis subsídia tríbuas et futúra. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and eternal God, by means of healthful continence you heal both minds and bodies; we humbly entreat thy Majesty, that appeased by the devout prayers of those who fast, you would grant us help both now and for time to come. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">Lauds II is said.</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <table:table table:name="Table898" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Illúmina, Dómine, * sedéntes in ténebris et umbra mortis, et dírige pedes nostros in viam pacis.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Enlighten, O Lord, * them that sit in darkness, and in the shadow of death: and direct our feet into the way of peace.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics131" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica IV Septembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>Judith 16</text:p>
   <table:table table:name="Table899" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Adonái, Dómine, * Deus magne et mirábilis, qui dedísti salútem in manu féminæ, exáudi preces servórum tuórum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>O Adonai, O Lord, * O great and glorious God, who hast given salvation into the hand of a woman; graciously hear the prayers of thy servants.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics132" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica V Septembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If there is no room for this Sunday, it is omitted together with its week.</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Esther 13:9</text:p>
   <table:table table:name="Table900" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dómine Rex omnípotens, * in dicióne tua cuncta sunt pósita, et non est qui possit tuæ resístere voluntáti.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>O Lord, almighty king, * all things are in thy power, and there is none that can resist thy will</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics133" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"><text:span text:style-name="VR"/></text:p>
   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics134" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6299in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sundays of October</text:p>
   <text:p text:style-name="RubricH">Collect for all hours, and Antiphons for Lauds and II Vespers, are found among the Sundays after Pentecost.</text:p>
   <text:p text:style-name="Head1">Dominica I Octobris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday falls upon the days from the fourth to the seventh of October, the month will have only four Sundays. In this case, the Third Sunday is omitted together with its week.</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Mcc 1:4</text:p>
   <table:table table:name="Table901" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Adapériat Dóminus * cor vestrum in lege sua et in præcéptis suis et fáciat pacem Dóminus Deus noster.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>May the Lord * open your heart in his law, and in his commandments, and may the Lord our God send you peace.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics135" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica II Octobris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>1 Mcc 6:39</text:p>
   <table:table table:name="Table902" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Refúlsit sol * in clypeos áureos, et resplenduérunt montes ab eis: et fortitúdo Géntium dissipáta est.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The sun shone * upon the shields of gold, and the mountains glittered therewith: and the strength of the nations was scattered.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics136" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica III Octobris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If this Sunday falls from the 18 to the 21 of October, it is omitted together with its week, and the Fourth Sunday of October is put in its place.</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHSm"><text:tab/>1 Mcc 2</text:p>
   <table:table table:name="Table903" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Lugébat autem Judam * Israël planctu magno et dicébat: Quómodo cecidísti, potens in prælio, qui salvum faciébas pópulum Domini?</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Moreover all Israel greatly mourned Judas * saying: How art thou fallen, O mighty in battle, who wrought the salvation of the Lord’s people!</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics137" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica IV Octobris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>2 Mcc 1:5</text:p>
   <table:table table:name="Table904" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Exáudiat Dóminus * oratiónes vestras et reconciliétur vobis nec vos déserat in témpore malo Dóminus, Deus noster.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>May the Lord hear * your prayers, and be reconciled unto you, and never forsake you in the evil time: O Lord our God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics138" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica V Octobris</text:p>
   <text:p text:style-name="Rubric">On the Sunday which occurs on a day from October 25 to October 31 inclusive, there is celebrated the feast of our Lord Jesus Christ the King, as noted in the Proper of the Saints, in which is made no commemoration of the occurring Sunday.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics139" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"><text:span text:style-name="VR"/></text:p>
   <text:p text:style-name="Head1NI"><draw:frame draw:style-name="fr7" draw:name="graphics140" text:anchor-type="as-char" svg:width="3.75in" style:rel-width="100%" svg:height="0.6299in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator3.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
    </draw:frame></text:p>
   <text:p text:style-name="RubricH"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sundays of November</text:p>
   <text:p text:style-name="RubricH">Collect for all hours, and Antiphons for Lauds and II Vespers, are found among the Sundays after Pentecost.</text:p>
   <text:p text:style-name="Head1">Dominica I Novembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Rubric">If the first Sunday falls upon the sixth or seventh of November, the month will have four Sundays, but the last Sunday is the first Sunday of Advent. In this case, this Sunday together with its week is omitted.</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Is 6:1,3</text:p>
   <table:table table:name="Table905" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Vidi Dóminum * sedéntem super sólium excélsum, et plena erat omnis terra majestáte ejus: et ea, quæ sub ipso erant, replébant templum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>I saw the Lord sitting upon a throne high and elevated, all the earth was full of his glory: and his train filled the temple.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics141" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica II Novembris</text:p>
   <text:p text:style-name="Rubric">This Sunday together with its week is always omitted.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics142" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica III Novembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table906" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Muro tuo * inexpugnábili circumcínge nos, Dómine, et armis tuæ poténtiæ prótege nos semper.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Surround us * with thine impregnable wall, O Lord, and protect always us with thy mighty arms.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics143" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica IV Novembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <table:table table:name="Table907" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Qui cælórum * cóntines thronum, et abyssos intuéris, Dómine, Rex regum, montes pónderas, terram palmo conclúdis: exáudi nos, Dómine, in gemítibus nostris.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>O Thou containest the circuit of the heavens, * and beholdest the depths, O Lord, King of kings, that weighest the mountains, that holdest the the earth in the palm of thy hand: graciously hear, O Lord, our groanings.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics144" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head1">Dominica V Novembris</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Is 62:6</text:p>
   <table:table table:name="Table908" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Super muros tuos, * Jerúsalem, constítui custódes; tota die et nocte non tacébunt laudáre nomen Dómini.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Upon thy walls, O Jerusalem, I have appointed watchmen, all the day and night, they shall not hold their peace, praising the Name of the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics145" text:anchor-type="as-char" svg:width="1.3126in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twelfth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table909" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS et miséricors Deus, de cujus múnere venit, ut tibi a fidélibus tuis digne et laudabíliter serviátur: tríbue, quæsumus, nobis; ut ad promissiónes tuas sine offensióne currámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and merciful God, of whose gift it comes that thy faithful people do thee worthy and laudable service; grant, we beseech thee, that we may run without stumbling to the attainment of thy promises. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 10:25-27</text:p>
   <table:table table:name="Table910" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Magíster, * quid faciéndo vitam ætérnam possidébo? At ille dixit ad eum: In lege quid scriptum est? quómodo legis? Díliges Dóminum Deum tuum ex toto corde tuo, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Master, * what must I do to possess eternal life? But he said to him: What is written in the law? how readest thou? Thou shalt love the Lord thy God with thy whole heart, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 10:30</text:p>
   <table:table table:name="Table911" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Homo quidam * descendébat ab Jerúsalem in Jéricho et íncidit in latrónes, qui étiam despoliavérunt eum et, plagis impósitis, abiérunt semivívo relícto.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>A certain man * went down from Jerusalem to Jericho, and fell among robbers, who also stripped him, and having wounded him went away, leaving him half dead.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics146" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Thirteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XIII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table912" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, da nobis fídei, spei, et caritátis augméntum: et, ut mereámur ássequi quod promíttis, fac nos amáre quod præcipis. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and everlasting God, give us an increase of Faith, Hope, and Charity; and that we may deserve to obtain that which you promise, make us love that which you command. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 17:12-13</text:p>
   <table:table table:name="Table913" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum transíret Jesus * quoddam castéllum, occurrérunt ei decem viri leprósi, qui stetérunt a longe et levavérunt vocem dicéntes: Jesu præcéptor, miserére nostri.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>As Jesus passed through * a certain town, there met him ten men that were lepers, who stood afar off; and lifted up their voice, saying: Jesus, master, have mercy on us.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 17:15</text:p>
   <table:table table:name="Table914" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Unus autem * ex illis, ut vidit quod mundátus est, regréssus est cum magna voce magníficans Deum, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And one * of them, when he saw that he was made clean, went back, with a loud voice glorifying God, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics147" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fourteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XIV Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table915" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">CUSTODI, Dómine, quæsumus, Ecclésiam tuam propitiatióne perpétua: et quia sine te lábitur humána mortálitas; tuis semper auxíliis et abstrahátur a nóxiis, et ad salutária dirigátur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">PROTECT, we beseech thee, O Lord, thy Church with thy perpetual mercy, and because without thee human frailty goes astray, may we be ever withheld by thy grace from what is hurtful, and directed to what is profitable. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 6:31-32</text:p>
   <table:table table:name="Table916" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Nolíte sollícite esse * dicéntes: Quid manducábimus aut quid bibémus? scit enim Pater vester quid vobis necésse sit, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Be not solicitous therefore, * saying, What shall we eat: or what shall we drink? For your Father knoweth what things you have need of, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 6:33</text:p>
   <table:table table:name="Table917" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quærite primum * regnum Dei et justítiam ejus, et hæc ómnia adjiciéntur vobis, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Seek ye therefore first * the kingdom of God, and his justice, and all these things shall be added unto you.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics148" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fifteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XV Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table918" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ECCLÉSIAM tuam, Dómine, miserátio continuáta mundet et múniat: et quia sine te non potest salva consístere; tuo semper múnere gubernétur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">MAY THY continual pity, O Lord, cleanse and defend thy Church; and because without thee she cannot endure in safety, may she ever be governed by thy bounty. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 7:11,12</text:p>
   <table:table table:name="Table919" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ibat Jesus * in civitátem, quæ vocátur Naim: et ecce defúnctus efferebátur fílius únicus matris suæ.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Jesus went * into a city that is called Naim: behold a dead man was carried out, the only son of his mother.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 7:16</text:p>
   <table:table table:name="Table920" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Prophéta magnus * surréxit in nobis, et quia Deus visitávit plebem suam.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>A great prophet * is risen up among us: and, God hath visited his people.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics149" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sixteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XVI Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table921" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">TUA nos, quæsumus, Dómine, grátia semper et prævéniat et sequátur: ac bonis opéribus júgiter præstet esse inténtos. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">LET thy grace, we beseech thee, O Lord, always go before us and follow us, and make us continually intent upon good works. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 14:1-4</text:p>
   <table:table table:name="Table922" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum intráret Jesus * in domum cujúsdam príncipis pharisæórum sábbato manducáre panem, ecce homo quidam hydrópicus erat ante illum: ipse vero apprehénsum sanávit eum, ac dimísit.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When Jesus went into * the house of one of the chief of the Pharisees, on the sabbath day, to eat bread, behold, there was a certain man before him that had the dropsy. But he taking him, healed him, and sent him away.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 14:8,10</text:p>
   <table:table table:name="Table923" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum vocátus fúeris * ad núptias, recúmbe in novíssimo loco, ut dicat tibi qui te invitávit: Amíce, ascénde supérius. Et erit tibi glória coram simul discumbéntibus, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When thou art invited * to a wedding, sit down in the lowest place, that he who invited thee may say to thee: Friend, go up higher. And thou shalt have glory before them that sit at table with thee, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics150" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Seventeenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XVII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table924" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DA, QUÆSUMUS, Dómine, pópulo tuo diabólica vitáre contágia: et te solum Deum pura mente sectári. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT to thy people, we beseech thee, O Lord, to avoid every contamination of the devil, and, with pure minds, to follow thee, the only God. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 22:36-37</text:p>
   <table:table table:name="Table925" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Magíster, * quod est mandátum magnum in lege? Ait illi Jesus: Díliges Dóminum Deum tuum ex toto corde tuo, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Master, * which is the greatest commandment in the law? Jesus said to him: Thou shalt love the Lord thy God with thy whole heart, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 22:42-44</text:p>
   <table:table table:name="Table926" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Quid vobis * vidétur de Christo? cujus fílius est? Dicunt ei omnes: David. Dicit eis Jesus: Quómodo David in spíritu vocat eum Dóminum dicens: Dixit Dóminus Dómino meo: Sede a dextris meis?</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>What think you * of Christ? Whose son is he? They all say to him: David’s. Jesus saith to them: How then doth David in spirit call him Lord, saying: The Lord said to my Lord, Sit on my right hand?</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics151" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Eighteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XVIII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table927" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DÍRIGAT corda nostra, quæsumus, Dómine, tuæ miseratiónis operátio: quia tibi sine te placére non póssumus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">MAY the working of thy mercy direct our hearts, we beseech thee, O Lord; for without thee, we are not able to please thee. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 9:2</text:p>
   <table:table table:name="Table928" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dixit Dóminus * paralytico: Confíde, fili, remittúntur peccáta tua.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The Lord said * to the man sick of the palsy: Be of good heart, son, thy sins are forgiven.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Lk 5:25, 18:43</text:p>
   <table:table table:name="Table929" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Tulit ergo * paralyticus lectum suum, in quo jacébat, magníficans Deum: et omnis plebs, ut vidit, dedit laudem Deo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Therefore he took up * his bed on which he lay, glorifying God: And all the people, when they saw it, gave praise to God.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics152" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Nineteenth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XIX Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table930" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS et miséricors Deus, univérsa nobis adversántia propitiátus exclúde: ut mente et córpore páriter expedíti, quæ tua sunt, líberis méntibus exsequámur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and merciful God, in thy bounty, graciously defend us from all that is hurtful; that, free in mind and body, we may with ready minds carry out the things that are thine. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 22:4</text:p>
   <table:table table:name="Table931" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dícite invitátis: * Ecce prándium meum parávi, veníte ad núptias, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Tell them that were invited, * Behold, I have prepared my dinner, come ye to the marriage, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 22:11-12</text:p>
   <table:table table:name="Table932" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Intrávit autem rex * ut vidéret discumbéntes, et vidit ibi hóminem non vestítum veste nuptiáli et ait illi: Amíce, quómodo huc intrásti non habens vestem nuptiálem?</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And the king went in * to see the guests: and he saw there a man who had not on a wedding garment. And he saith to him: Friend, how camest thou in hither not having on a wedding garment?</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics153" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twentieth Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XX Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table933" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">LARGÍRE, quæsumus, Dómine, fidélibus tuis indulgéntiam placátus et pacem: ut páriter ab ómnibus mundéntur offénsis, et secúra tibi mente desérviant. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">BE APPEASED, O Lord, we beseech thee, and grant to thy faithful people pardon and peace; that they may both be cleansed from all their offenses, and serve thee with secure minds. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 4:46-47</text:p>
   <table:table table:name="Table934" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Erat quidam régulus, * cujus fílius infirmabátur Caphárnaum. Hic cum audísset quod Jesus veníret in Galilæam, rogábat eum ut sanáret fílium ejus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And there was a certain ruler, * whose son was sick at Capharnaum. He having heard that Jesus was come into Galilee, prayed him to heal his son.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Jn 4:53</text:p>
   <table:table table:name="Table935" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cognóvit autem pater * quia illa hora erat, in qua dixit Jesus: Fílius tuus vivit; et crédidit ipse et domus ejus tota.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>So the father knew, * that it was at the same hour that Jesus said: Thy son liveth; and himself believed, and his whole house.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics154" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twenty-first Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XXI Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table936" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">FAMILIAM tuam, quæsumus, Dómine, contínua pietáte custódi: ut a cunctis adversitátibus, te protegénte, sit líbera; et in bonis áctibus tuo nómini sit devóta. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GUARD thy household, we beseech thee, O Lord, with continued goodness; that, through thy protection, it may be free from all adversities, and by good works be devoted to thy name. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 18:26-28</text:p>
   <table:table table:name="Table937" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dixit autem * dóminus servo: Redde quod debes. Prócidens autem servus ille rogábat eum dicens: Patiéntiam habe in me, et ómnia reddam tibi.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>And the Lord said * to his servant: Pay what thou owest. But that servant falling down, besought him, saying: Have patience with me, and I will pay thee all.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 18:32-33</text:p>
   <table:table table:name="Table938" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Serve nequam * omne débitum dimísi tibi, quóniam rogásti me; nonne ergo opórtuit et te miseréri consérvi tui, sicut et ego tui misértus sum? allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Thou wicked servant, I forgave thee all the debt, because thou besoughtest me: Shouldst not thou then have had compassion also on thy fellow servant, even as I had compassion on thee? alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics155" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twenty-second Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XXII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table939" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, refúgium nostrum, et virtus: adésto piis Ecclésiæ tuæ précibus, auctor ipse pietátis, et præsta; ut, quod fidéliter pétimus, efficáciter consequámur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, our refuge and strength, the author of all piety, give ear to the devout prayers of thy Church; and grant that what we ask with faith, we may obtain effectually. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 22:16</text:p>
   <table:table table:name="Table940" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Magíster, * scimus quia verax es et viam Dei in veritáte doces, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Master, we know that thou art a true speaker, and teachest the way of God in truth, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 22:21</text:p>
   <table:table table:name="Table941" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Réddite ergo * quæ sunt Cæsaris Cæsari, et quæ sunt Dei Deo, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Render therefore to Caesar the things that are Caesar’s; and to God, the things that are God’s, alleluia</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics156" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twenty-third Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XXIII Post Pentecosten</text:p>
   <text:p text:style-name="Head2">II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table942" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">ABSÓLVE, quæsumus, Dómine, tuórum delícta populórum: ut a peccatórum néxibus, quæ pro nostra fragilitáte contráximus, tua benignitáte líberémur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ABSOLVE thy people from their offenses, we beseech thee, O Lord; that through thy bountiful goodness we may be delivered from the bonds of sin, which through our frailty we have contracted. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mat 9:21</text:p>
   <table:table table:name="Table943" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dicébat enim * intra se: Si tetígero fímbriam vestiménti ejus tantum, salva ero.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>For she said * within herself: If I shall touch but the hem of his garment, I shall be healed.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Mt 9:22</text:p>
   <table:table table:name="Table944" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>At Jesus convérsus * et videns eam dixit: Confíde, fília, fides tua te salvam fecit, allelúja.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>But Jesus turning * and seeing her, said: Be of good heart, daughter, thy faith hath made thee whole, alleluia.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics157" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sundays after Epiphany</text:p>
   <text:p text:style-name="Rubric">The Sundays after Pentecost cannot be fewer than 23, or more than 28. But when they are more than 24, then, after the twenty-third Sunday, there are used up those things which were not required after Epiphany, as regards the collect, homily, and antiphons at the <text:span text:style-name="NonRubric">Benedíctus</text:span> and the <text:span text:style-name="NonRubric">Magníficat</text:span>, according to the following table:</text:p>
