   <text:p text:style-name="Rubric"/>
   <text:p text:style-name="Rubric">Select the column with the correct number of Sundays after Pentecost, then select the row which represents the current week after Pentecost. The far right column will give the Office to be used for that week.</text:p>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Third Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica III Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">Quæ Superfuit, II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table946" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">OMNÍPOTENS sempitérne Deus, infirmitátem nostram propítius réspice: atque ad protegéndum nos déxteram tuæ majestátis exténde. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">ALMIGHTY and everlasting God, graciously look upon our infirmity, and, for our protection, stretch forth the right hand of thy Majesty. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Rubric">The remaining things proper to this Sunday will be omitted, since if they are to be used up after Pentecost, the Sunday will always occur together with the feast of our Lord Jesus Christ the King.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics158" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fourth Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica IV Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">Quæ Superfuit, II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table947" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">DEUS, qui nos in tantis perículis constitútos, pro humána scis fragilitáte non posse subsístere: da nobis salútem mentis et córporis; ut ea, quæ pro peccátis nostris pátimur, te adjuvánte vincámus. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">O GOD, you know that, placed as we are amid such great dangers, we cannot by reason of our human frailty stand; grant us health of mind and of body, that, by thy help, we may overcome the things which we suffer for our sins. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 8:23-25</text:p>
   <table:table table:name="Table948" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Ascendénte Jesu * in navículam, ecce motus magnus factus est in mari: et suscitavérunt eum discípuli ejus, dicéntes: Dómine, salva nos, perímus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When Jesus entered * into the boat, behold a great tempest arose in the sea: and his disciples awaked him, saying: Lord, save us, we perish.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 8:25-26</text:p>
   <table:table table:name="Table949" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dómine, salva nos, * perímus: ímpera, et fac, Deus, tranquillitátem</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Lord, save us, we perish: command, O God, and make a great calm.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics159" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Fifth Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica V Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">Quæ Superfuit, II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table950" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">FAMÍLIAM tuam, quæsumus, Dómine, contínua pietáte custódi: ut, quæ in sola spe gratiæ cæléstis innítitur, tua semper protectióne muniátur. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">WE BESEECH thee, O Lord, in thy unceasing goodness, guard thy family; that we who lean only upon the hope of thy heavenly grace, may always be defended by thy protection. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 13:27-28</text:p>
   <table:table table:name="Table951" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Dómine, * nonne bonum semen seminásti in agro tuo? unde ergo habet zizánia? et ait illis: hoc fecit inimícus homo.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Sir, * didst thou not sow good seed in thy field? whence then hath it cockle? And he said to them: An enemy hath done this.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 13:30</text:p>
   <table:table table:name="Table952" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Collígite * primum zizánia, et alligáte ea in fascículos ad comburéndum: tríticum autem congregáte in hórreum meum, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Gather up * first the cockle, and bind it into bundles to burn, but the wheat gather ye into my barn, saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics160" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Sixth Sunday after the Epiphany</text:p>
   <text:p text:style-name="Head1">Dominica VI Post Epiphaniam</text:p>
   <text:p text:style-name="Head2">Quæ Superfuit, II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table953" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">PRÆSTA, quæsumus, omnípotens Deus: ut semper rationabília meditántes; quæ tibi sunt plácita, et dictis exsequámur, et factis. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">GRANT, we beseech thee, almighty God, that ever fixing our thoughts on such things that are reasonable, we may, both in word and in work, do that which is pleasing to thee. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 13:31-32</text:p>
   <table:table table:name="Table954" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Símile est * regnum cælórum grano sinápis, quod mínimum est ómnibus semínibus: cum autem créverit, majus est ómnibus oléribus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The kingdom of heaven * is like to a grain of mustard seed, which is the least indeed of all seeds; but when it is grown up, it is greater than all herbs.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 13:33</text:p>
   <table:table table:name="Table955" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Símile est * regnum cælórum ferménto, quod accéptum múlier abscóndit in farínæ satis tribus, donec fermentátum est totum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>The kingdom of heaven * is like to leaven, which a woman took and hid in three measures of meal, until the whole was leavened.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics161" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Body"/>
   <text:p text:style-name="Hidden1">Trinitytide</text:p>
   <text:p text:style-name="Hidden2">Twenty-fourth and Last Sunday after Pentecost</text:p>
   <text:p text:style-name="Head1">Dominica XXIV et Ultima</text:p>
   <text:p text:style-name="Head2">Post Pentecosten, II classis</text:p>
   <text:p text:style-name="Head2">Collect</text:p>
   <table:table table:name="Table956" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyLDrop">EXCITA, quæsumus, Dómine, tuórum fidélium voluntátes: ut divíni óperis fructum propénsius exsequéntes; pietátis tuæ remédia majóra percípiant. Per Dóminum.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyEDrop">STIR up, we beseech thee, O Lord, the wills of thy faithful people; that more earnestly seeking after the fruit of good works, they may receive more abundant helps from thy mercy. Through our Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad I Vésperas</text:p>
   <text:p text:style-name="Rubric">The antiphon at the Magnificat, which occurs in its place among the Sundays, as above.</text:p>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad Laudes</text:p>
   <text:p text:style-name="Head3">Benedictus</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 24:15</text:p>
   <table:table table:name="Table957" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Cum vidéritis * abominatiónem desolatiónis quæ dicta est a Daniéle prophéta, stantem in loco sancto: qui legit, intélligat.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>When you shall see * the abomination of desolation, which was spoken of by Daniel the prophet, standing in the holy place: he that readeth let him understand.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:p text:style-name="Head2">ad II Vésperas</text:p>
   <text:p text:style-name="Head3">Magnificat</text:p>
   <text:p text:style-name="RubricHidden"><text:tab/>Matt 24:34-35</text:p>
   <table:table table:name="Table958" table:style-name="TableParallel">
    <table:table-column table:style-name="TableParallel.A"/>
    <table:table-column table:style-name="TableParallel.B"/>
    <table:table-row>
     <table:table-cell table:style-name="TableParallel.A1" office:value-type="string">
      <text:p text:style-name="BodyL"><text:span text:style-name="Rubric">Ant. </text:span>Amen dico vobis * quia non præteríbit generátio hæc, donec ómnia fiant: cælum et terra transíbunt, verba autem mea non transíbunt, dicit Dóminus.</text:p>
     </table:table-cell>
     <table:table-cell table:style-name="TableParallel.B1" office:value-type="string">
      <text:p text:style-name="BodyE"><text:span text:style-name="Rubric">Ant. </text:span>Amen I say to you, * that this generation shall not pass, till all be done. Heaven and earth shall pass, but my words shall not pass, saith the Lord.</text:p>
     </table:table-cell>
    </table:table-row>
   </table:table>
   <text:p text:style-name="BodySm"/>
   <text:h text:style-name="Head3" text:outline-level="4"><draw:frame draw:style-name="fr8" draw:name="graphics162" text:anchor-type="as-char" svg:width="1.1972in" style:rel-width="35%" svg:height="0.1098in" style:rel-height="scale" draw:z-index="0"><draw:image xlink:href="../Images/separator4.tif" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/>
            </draw:frame></text:h>
   <text:p text:style-name="Spacer"/>
